OtogiData = {
    OTOGI_217021: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "井河アサギ", "Serif": "（くっ……はぁっ、しまった……あのボラコは洗脳薬まで開発していたんだ。こういった薬が、やつの組織の末端にも流れていると、考えるべきだった……）", "Motion": 1, "Voice": "c_1702_1_017_1702", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "博士", "Serif": "だいぶ薬が効いてきたか……見れば見るほど、いい女だね。そこらの小娘にはない、雌が熟した匂いというのかねぇ……っすぅーっ、んふぁーっ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "井河アサギ", "Serif": "くっ……や、やめなさいっ、耳に息をふきかけ……くっ、ふううっ……んんぅうぅっ！？", "Motion": 1, "Voice": "c_1702_1_018_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "", "Serif": "男が息を吹きかける様子には嫌悪感しかなかった。しかし、耳は驚くほど敏感に、その刺激を全身に伝える。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "", "Serif": "腕を固定されたアサギに、今度は先端が筆のようになった装置が、無防備になった豊乳へと迫る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "井河アサギ", "Serif": "はぁっ、あっ、んんんぅうっ……！？　耳だけで、こん、なに……！？　まさか投与した薬って……んひぁああああっ！？　だめ、胸、それっ、はぁっ、ああふぁあああっ！！", "Motion": 1, "Voice": "c_1702_1_019_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "博士", "Serif": "そ、投与したのは感度3,000倍になるお薬だよ。さあ、脳がセックスのことしか考えられなくなるまで、お楽しみといこうじゃないか", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "井河アサギ", "Serif": "くっ、はぁっ、待ちなさいっ、3000倍ってそれは……！　あんな状態でいま、いきなり挿入れられたら……！　あぁっ、んっああぁぁっ！", "Motion": 1, "Voice": "c_1702_1_020_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "男は戦闘服をずらし、局部に容赦なく剛直を突き立てた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "", "Serif": "本来なら膣肉の摩擦に耐え難い痛みが伴うはずだったが……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 11, "Name": "井河アサギ", "Serif": "あああぁぁぁっ！？　いきなりっ、んんっ、奥までっ、くっ、んんぅっ、はああぁぁっ……！！", "Motion": 1, "Voice": "c_1702_1_021_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "博士", "Serif": "おっほぉ♪　こりゃすごい、こんなに濡れてるとは……！　とんでもない淫乱女だな、んー？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "井河アサギ", "Serif": "んっくううぅぅ！　はぁっ、これは、薬のせいっ、はぁっ、んっ、んぅうううっっ！？　誰だって、んっ、淫乱にさせられるのが、その薬、でしょうっ……！", "Motion": 1, "Voice": "c_1702_1_022_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "博士", "Serif": "いやいや、ここまでは濡れない。自分のオマンコがどれだけいやらしくヨダレ垂らしてるか、自覚してるのかな？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "井河アサギ", "Serif": "あぅっ、んんっふううっ！　こ、こんなっ、先を筆でくすぐられてるだけ、なのにっ、はああっ、胸だけでっ、ああっ、イキそうっ！　んんぅううっ！", "Motion": 1, "Voice": "c_1702_1_023_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "井河アサギ", "Serif": "（んんっ、はぁっ、そう……これが3000倍の刺激……！　１回抜き挿しされるだけで、イキそうになるっ……！　久しぶりに、んんっ、思い出して、きたわ……くうっ）", "Motion": 1, "Voice": "c_1702_1_024_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "博士", "Serif": "普通はちょっと湿ってくる程度なんだ。やっぱり前戯もしっかりやらなきゃ、こうはならない。チンポ動かすたびに音がするのは、聞こえてるんだろう？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "井河アサギ", "Serif": "んんっ、はぁっ、そんなもの、聞こえないわ……！　はぁっ、あああうううっ！", "Motion": 1, "Voice": "c_1702_1_025_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "井河アサギ", "Serif": "（聞こえてくる……こんな男のチンポで、私のオマンコが弄ばれている音っ、んっ、ぴちゃぴちゃ、みっともない音をたててっ……）", "Motion": 1, "Voice": "c_1702_1_026_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "博士", "Serif": "薬を投与した際の感度に個人差があるのは何故か。それはね、経験なんだ。僕のデータが証明してるんだよ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "井河アサギ", "Serif": "な……っ！？　け、経験っ、んっ、どういう、意味っ？　はぁっ、あっ、ああっ！　く、んふぅっぅ、わた、しの、ことっ、何を知ってるのよ……！", "Motion": 1, "Voice": "c_1702_1_027_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "まさかアサギがかつて、感度3000倍の身体にされたことを知っているのか。この男はどこまでアサギのことを――", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "快感に耐えながらも、アサギは男の言動を警戒する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "博士", "Serif": "快楽は脳に刻まれる。これは一生消えない。通常のセックスもそうだ。普通は理性で抑制するから中毒にはならないだけだ。でも、薬でそれを壊すと……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "筆の速度が早まる。同時に、男の抽挿も徐々に加速し始めた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 26, "Name": "井河アサギ", "Serif": "んんっふううああああっ！　むね、やめっ、はぁっ、あたま、おかしく、なりゅ、からぁ、んんぅうあああっ！", "Motion": 1, "Voice": "c_1702_1_028_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "", "Serif": "徐々にろれつの回らなくなってきたアサギの姿を満足気に眺め、男は結合部から垂れる愛液を指ですくい、口に含んだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "博士", "Serif": "んんーっ、実に濃いね。経験豊富な、熟した雌の味がするよ。興奮してきちゃうなぁ、ふふぅ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "井河アサギ", "Serif": "こ、このヘンタイ……っ、んっ、はぁっ、ナカでぇっ、また、おっき、くっ、んっ、ふぐうぅうぅっ！？　んっ、おっ、おぉ、おぅんっっ！", "Motion": 1, "Voice": "c_1702_1_029_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "井河アサギ", "Serif": "んぎぃ、いぃっ、やっ、はぁっ、おっ、オマンコ、しびれて、んぅううっ！", "Motion": 1, "Voice": "c_1702_1_030_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "", "Serif": "おかしく、なってきちゃっ、はぁっ、んぐっ、おっ、ほぉっっ！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "博士", "Serif": "ハッキリ言って、オナニーもしたことのない処女に、この薬は言うほど効かない。ちゃんとデータがある", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "井河アサギ", "Serif": "……っ！　それは、つまりっ、きひゃ、まっ、そんな子にも、こんなっ……ことぉっ！　この、クズ、がっ……んっ、んぉっ、おほぉぉぉっっ！！", "Motion": 1, "Voice": "c_1702_1_031_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "博士", "Serif": "つまりね、きみはこれまで何本も咥えこんできた経験から、チンポは気持ちいいものだと、もうオマンコが記憶しちゃっているわけだよね", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "博士", "Serif": "それを１ワードで表わせと言われたら……『淫乱』しかないだろ？　ほら、もっと淫乱マンコ開いて……はぁ、はぁっ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "井河アサギ", "Serif": "んぁぁああぁあぁっ！！　だめっっ、これ、いじょっ、だめぇっ！！　あっ、あぐっ、オマンコっ、おかしく、なっちゃう、からぁっ！！", "Motion": 1, "Voice": "c_1702_1_032_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "", "Serif": "男の主張には一理あるのかもしれない――朦朧とする意識の中、アサギはふと感じていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "", "Serif": "かつて感度３０００倍を経験していたから、今回も耐えられる――というものではないだろう。男の言うとおり、身体はあの感覚を、耐え難い快楽の拷問を覚えている。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "井河アサギ", "Serif": "んくぁああああっっ！？　あっふぁああっ、チンポのっ、かんかくっ、今度こそ本当にっ、はぁっ、忘れられなく、なっちゃうっ、んっ、あっぁあああっ！", "Motion": 1, "Voice": "c_1702_1_033_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "井河アサギ", "Serif": "あたまの、なかっ……ぜんぶ、チンポのことで、いっぱいになっちゃうううぅぅっっ！！　んっ、んぉっ、おおっ、おほぉぉおおおぉぉっ！！", "Motion": 2, "Voice": "c_1702_1_034_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "井河アサギ", "Serif": "おくっ、んんぅっ、ずんずんきてるっ、んぉうっ、んぉ、こわ、れるううぅっ……！", "Motion": 2, "Voice": "c_1702_1_035_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "博士", "Serif": "はぁ、はぁっ、すごい……部屋の中が雌の匂いでいっぱいになってる……！　もっと、淫らな本性を見せろ！　僕の、ザーメンを吸い取ってな……！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "井河アサギ", "Serif": "んぉっ、おぉおおぉ……っ！？　や、やめっ、出さないでぇぇええぇっ！！　こんな、感じてるのにっ、出されたらぁっ、あっ、ああああぁぁぁ――っ！？", "Motion": 2, "Voice": "c_1702_1_036_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "", "Serif": "ひときわ大きく、男の肉棒が膨張したことを、アサギが膣から感じ取った瞬間――精液が勢いよく解き放たれた。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 45, "Name": "井河アサギ", "Serif": "んんぐうぅうおぉおおっ！？　おっ、おぐっ、んほぉぉぉおっ、いぐっ、いぐぅぅぅっっ！？", "Motion": 1, "Voice": "c_1702_1_037_1702", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 46, "Name": "", "Serif": "精液が腟内を満たす勢いが刺激となり、ついにアサギは絶頂した。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 47, "Name": "博士", "Serif": "さて、準備運動はここまでだね。もう少し調教しておこうか。明日は少しでもキミが高値で売れるように……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 48, "Name": "", "Serif": "男はそう言うと、再び腰を揺らし始める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 49, "Name": "井河アサギ", "Serif": "や、やめええぇぇっ……！？　んぁあ、ああぁううっ、もぉ、ひぃんっ！　動いただけで、イッちゃうからぁぁああっ、あっ、いぐっ、いぐううぅっ！？", "Motion": 1, "Voice": "c_1702_1_038_1702", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 50, "Name": "", "Serif": "男の責め苦はまだ始まったばかり。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "オークション会場への『出荷』は翌朝を予定していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217022: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "井河アサギ", "Serif": "さあ、ここで抑え込まれたらどうする。自分の身体をうまく使えば、抜け出せるはずだ", "Motion": 1, "Voice": "c_1702_2_019_1702", "StillPath": null, "BGM": "bgm_44", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "アサギに組み敷かれながら、懸命にもがく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "", "Serif": "小雨がぱらつき始めるが、アサギは意に介さず訓練を続ける。もちろん、実戦に天候など関係ないことはこちらも承知している。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "", "Serif": "だが……雨に濡れた戦闘スーツは、顔を覆うほどの豊かな胸の先端がぷっくりと浮く様を、より際立たせていて……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "井河アサギ", "Serif": "それで？　ここからどうする？　そっちが右に逃げるなら、敵も当然、行く手を阻んで――", "Motion": 1, "Voice": "c_1702_2_020_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "こっちの状況を知ってか知らずか、体勢が変わりこちらの顔に豊乳が乗る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "", "Serif": "その感触に、気がつけば愚息はすっかり固くなっていて……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "井河アサギ", "Serif": "……っ、これ、私の身体に反応して……？　ふうん……。仕方ないわね。こうなってしまったらトレーニングに集中できないでしょうから……カリキュラムを変えるわ", "Motion": 1, "Voice": "c_1702_2_021_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "井河アサギ", "Serif": "んっ……んんふううぅっ、ほら、挿入ってるのが見える？　ん、はぁっ、なかなか立派なチンポ、持ってるじゃないの……", "Motion": 1, "Voice": "c_1702_2_022_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 10, "Name": "", "Serif": "歴戦の猛者であるアサギに、自分の唯一の武器を褒められ、なんだかこそばゆくなる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "", "Serif": "こちらの身体にまたがったアサギは、そのまま戦闘服をずらし、その陰裂で肉棒を飲み込んでしまった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "井河アサギ", "Serif": "敵は男だけとは限らないわ。幹部に女がいることも少なくない。そういうとき、これで虜にできれば戦いはぐっと有利になる", "Motion": 1, "Voice": "c_1702_2_023_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "井河アサギ", "Serif": "言わば男性版の房中術。こういった能力も磨いておいて損はないの。特に、あなたには強力なエルマイトという武器があるわ", "Motion": 1, "Voice": "c_1702_2_024_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "井河アサギ", "Serif": "敵の女幹部を身体の内側からエルマイトを打ち込んで無力化できれば、かなり強力な技になる可能性がある。覚えておきなさい", "Motion": 1, "Voice": "c_1702_2_025_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "", "Serif": "そうだ、これはあくまで訓練なのだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "", "Serif": "もちろん訓練内容が内容なので、ペニスの硬さは維持しなくてはいけないが、変に期待してはいけない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "", "Serif": "そう言い聞かせていたのに、アサギは笑みを浮かべてこちらを見下ろしていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "井河アサギ", "Serif": "ふふっ、本当にこんなに勃起させてるなんて……もしかしたら、半勃ちくらいかと思っていたのに", "Motion": 1, "Voice": "c_1702_2_026_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "井河アサギ", "Serif": "私なんて、もういい年で……若くもないのよ。なのに、ちょっと密着した程度でこんなにするなんて……ずいぶん溜め込んでいたのね", "Motion": 1, "Voice": "c_1702_2_027_1702", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "", "Serif": "毎日就寝前に必ずオナニーしていることを言い添え、これは溜まっているのではなく、純粋にアサギの魅力に反応したのだと説明する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "", "Serif": "あのアサギの身体が、実際に触れたらこんなにも淫らな魅力に溢れているとは。その事実だけで射精しかねない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "井河アサギ", "Serif": "私の……魅力……？　本当に、そんなこと思って……？　ふふっ、言われて悪い気はしないけど……", "Motion": 1, "Voice": "c_1702_2_028_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 23, "Name": "井河アサギ", "Serif": "それを言うなら、私だって……んっ、はぁああっ、ほら、愉しんでるっていうのが、わかる……？　あなたの身体から滲み出るエルマイトの影響を受けてしまったのか、それとも……", "Motion": 1, "Voice": "c_1702_2_029_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 24, "Name": "井河アサギ", "Serif": "ん、はぁ……んっ、あっはぁっ♪　そんなに魅力を感じてくれてるなら、ん、あぁっ、んっ、あなたのチンポで私が女になっていくところ……そこで見てなさい……", "Motion": 1, "Voice": "c_1702_2_030_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "大胆に、いやらしく腰を上下させるアサギ。それに伴って、先ほど顔を圧迫していた豊乳が、ゆさゆさと頭上で揺れる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "", "Serif": "その薄桃に色づいた先端は、彼女の興奮を示すように固く尖っていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "井河アサギ", "Serif": "んっ、はんっ、っふうううぅっ、いい、わぁ……あんっ、あっっ、んんっ♪　オマンコ、すっごく熱くなってるのが……わかる……？　んっ、はぁんっ……", "Motion": 1, "Voice": "c_1702_2_031_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "井河アサギ", "Serif": "んっ、ひぁ、ああぁぁうぅっ、き、きもひぃっ、ひぁあああんんっっ♪　オマンコの奥までぇっ、はひぃ、んんっ、チンポ、届いてるぅ……っ", "Motion": 1, "Voice": "c_1702_2_032_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "", "Serif": "もっと奥へと誘うように、竿肌を撫でる肉襞の感触。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "その快楽に思わずうめく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "", "Serif": "はしたなくも艶かしく、大きく開いたアサギの股間からは、牝潮が繋がった部分を濡らし、垂れ落ちる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "", "Serif": "そして、こちらの下腹部に彼女の股間が打ち付けられるたびに、淫猥な水音を響かせていた。雨音に紛れることもない、力強い音。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "井河アサギ", "Serif": "んんふうぅううっ、チンポぉっ、すごぉいっ、んぅっ、オマンコ、ぐちゃぐちゃにされちゃってるぅっ、あううぅぅんっ！", "Motion": 1, "Voice": "c_1702_2_033_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "井河アサギ", "Serif": "あなたも、んっ、遠慮なんて、しなくていいのよっ、はぁっ、あぁううぅんっ！　もっとチンポ、気持ちよくなってぇっ、あぁっ", "Motion": 1, "Voice": "c_1702_2_034_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "井河アサギ", "Serif": "あんっ、ほらもっと、あえいでるところ聞かせ……ひぁああううぅぅんっ！？", "Motion": 1, "Voice": "c_1702_2_035_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "アサギの勧めどおり、自分の快楽のためにと遠慮なく下から突き上げる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "井河アサギ", "Serif": "んひいぃいぃいぃいっ！？　おっ、んぉっ、おひぃいいぃっ！？　そ、それ、すごっ、んっ、オマンコ、下からっ、ぐちゅぐちゅに、されてっ、んふぅっ！", "Motion": 2, "Voice": "c_1702_2_036_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "井河アサギ", "Serif": "もう、イキそうっ、わたしっ、イッちゃうっ、んひぁああっ！？　はぁっ、ひぁっ、いっしょに、あなたもっ、来てぇっ！", "Motion": 2, "Voice": "c_1702_2_037_1702", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "アサギの腰つきも最高の快楽だったのだが、やはり自分で動くと一気に射精感が高まっていく。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "", "Serif": "そしてその絶頂の予感のまま、勢いを制することもなく、白濁を彼女の子宮口めがけてぶちまけた。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "井河アサギ", "Serif": "んぁあううううううぅぅうぅぅうぅ――っっっ！？　ひぁっ、あひぃ、ザーメン、入って、きてるぅっ！　んぉっ、おほぉ、イクっ、イクうううぅぅぅっ！！", "Motion": 1, "Voice": "c_1702_2_038_1702", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 42, "Name": "井河アサギ", "Serif": "はぁっ、あ、あはぁ……これが、あなたのチンポ……いえ、エルマイトの威力……さすがね……", "Motion": 1, "Voice": "c_1702_2_039_1702", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 43, "Name": "", "Serif": "うっとりと目を細めて絶頂の余韻を噛み締めていたアサギだったが、やがてこちらに視線を向けてニヤリと笑みを浮かべる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 44, "Name": "井河アサギ", "Serif": "私がせっかく、指導者として理性を保とうとしていたのに……あなたがいけないのよ。私の中の女の部分を、こんなに刺激するんだから……", "Motion": 1, "Voice": "c_1702_2_040_1702", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 45, "Name": "井河アサギ", "Serif": "火を付けた責任は、きちんと取ってもらうわ。いいわね？", "Motion": 1, "Voice": "c_1702_2_041_1702", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 46, "Name": "", "Serif": "願ってもない申し出に頷き返し、そして……アサギとの訓練はまだまだ続いたのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217031: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "村人１", "Serif": "ほう、本当にひとりで来たのか", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "井河さくら", "Serif": "それで？　約束通り来たんだから、情報を教えなさいよ", "Motion": 1, "Voice": "c_1703_1_015_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "村人１", "Serif": "ああ、もちろんだ。だが、俺達の試練に耐えられたらな", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "井河さくら", "Serif": "はあ？　話が違うんだけど！　卑怯だよ！", "Motion": 1, "Voice": "c_1703_1_016_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "村人２", "Serif": "ここにひとりで来ただけで情報がもらえると思ったのか？　それは、試練への挑戦権を手に入れただけだったつーの", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "井河さくら", "Serif": "じゃあ……どうしろっての？", "Motion": 1, "Voice": "c_1703_1_017_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "村人１", "Serif": "俺たち全員を相手に、耐えきれたらおまえの勝ちだ。おい、おまえたち", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "", "Serif": "男の合図で、壁だと思っていた振り落としが落ちて――全裸の男が並んでいた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "村人９８", "Serif": "あっ、イクっ！！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "井河さくら", "Serif": "はぁ、ふぅ……これで９８人だね。１００人まで、あと２人……きゃっ！？", "Motion": 1, "Voice": "c_1703_1_018_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "", "Serif": "男を口でイカせたさくらは、背後から近付いた男に羽交い締めにされる。同時に、別の男が正面から彼女の豊満な胸にむしゃぶりついてきた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "村人９９", "Serif": "んっっふぉおおっ、ガマンできねぇ！　なんだこのいやらしいデカパイは！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "井河さくら", "Serif": "はぁううぅぅんっ！！　んっ、そんなにがっついて……チンポもビンビンだし、ちょっと触ったらイッちゃうんじゃないの……", "Motion": 1, "Voice": "c_1703_1_019_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "井河さくら", "Serif": "そしたら９９人、後ろのヤツと合わせて１００人達成……っ、んんっ、はぁっ、あっ", "Motion": 1, "Voice": "c_1703_1_020_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "", "Serif": "集まった１００人の男たちは、アサギに次ぐ歴戦の猛者たるさくらの性技の前に、次々と陥落していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "", "Serif": "その勝因は、影遁の術を駆使したスピード勝負。さくらがイク前に１００人イカせることが条件だったので、先手必勝で手や口を使って抜いてしまったのだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "", "Serif": "そう、さくらを責めさせなければ、イクこともない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "だが……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "井河さくら", "Serif": "んぅっ、はっ、なにこいつ、舌使い、上手っ……！？　で、でもっ、おっぱい舐められたくらいで、イクわけないしっ……んんっ！", "Motion": 1, "Voice": "c_1703_1_021_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 20, "Name": "井河さくら", "Serif": "え、ちょ、後ろから……あんた、挿れてきて……っ？　ふん、ひとりくらい、なんてことないし……っ", "Motion": 1, "Voice": "c_1703_1_022_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "", "Serif": "なにせ相手は１００人。もちろん、防ぎきれずに挿入を許したことはあった。それでも彼女は耐えきってきたのだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "井河さくら", "Serif": "あんたの粗チンで、どうにかできると思ったら間違いだからっ！　んぅっ、はぁっ、あっ、これくらいで、イクわけっ、ないし……っ、ふんっ……", "Motion": 1, "Voice": "c_1703_1_023_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "だが、ここにきて正面の男の舌技を受け、さくらの身体は急速に牝の本能に目覚めはじめてしまう。そこへ来ての挿入に、彼女の媚肉は激しく収縮する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "村人１００", "Serif": "んぉおおおっ！　なんつーマンコの締め付け……、すごい、ぞっ、くうう！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 25, "Name": "井河さくら", "Serif": "んひぁああああぁぁっ！？　やだ、ナカでっ、はぁっ、膨らませない、でぇ……っ！", "Motion": 1, "Voice": "c_1703_1_024_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "井河さくら", "Serif": "でもっ、そっちだって……はぁっ、あっ、私のオマンコで、んんっ、オチンポ気持ち良くなっちゃってんでしょぉ……っ、はぁっ、あぁふうぅううんっ！", "Motion": 1, "Voice": "c_1703_1_025_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "井河さくら", "Serif": "早くっ、んっ、んぃいいっ、イキなさい、よぉっ……！　はぁっ、オチンポがイキたいって、私のっ、オマンコのナカでっ、びくびくしてるの、伝わってきてるん、だからぁ……！", "Motion": 1, "Voice": "c_1703_1_026_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "井河さくら", "Serif": "（はぁっ、はぁ……これ、ヤバいかもっ……こいつのオチンポ、デカいくせにすっごいフィットして……！？）", "Motion": 1, "Voice": "c_1703_1_027_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "村人１００", "Serif": "くううっ、すごい締付けだ！　搾り取られる……！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "井河さくら", "Serif": "んんぅううっ、くっ、くふぅ、これ、くらい……っ、はぁっ、んんっ、耐えてみせてやるっつーの……っ、はぁっ、んんぅうううっ！", "Motion": 1, "Voice": "c_1703_1_028_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "井河さくら", "Serif": "こんな、んんっ、粗末なオチンポでっ、はぁっ、このさくらさんがイカされるわけっ、んっ、ない、でしょぉ……？　んっ、あぁううぅうんっ！", "Motion": 1, "Voice": "c_1703_1_029_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "", "Serif": "必死に快楽に抗いながら、さくらは身体を震わせる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "", "Serif": "情も何もない村人相手とは言え、これだけの男根に触れればさくらとて興奮しないはずがない。それでも、彼女は理性で抑えこむ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "村人１", "Serif": "バカな……１００人を相手に、こんな……化け物か、この女……！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "井河さくら", "Serif": "これが対魔忍……井河さくらだよっ！　今まで、私が経験してきた修羅場は……こんなもんじゃ、ないんだからっ、んっ、はぁっ！", "Motion": 1, "Voice": "c_1703_1_030_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "井河さくら", "Serif": "どれだけ敵の策略にハマっても、罠にかけられても、私は耐え抜いてきたんだからぁっ、はぁっ、あぁっ！", "Motion": 1, "Voice": "c_1703_1_031_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "井河さくら", "Serif": "はああ……！　ああっ、オチンポのっ、カリ首んとこがっ、はぁっ、オマンコの入り口、引っかかって……くううっ、気持ち、いいけどっ、でも、この程度……あぁっ！", "Motion": 1, "Voice": "c_1703_1_032_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "", "Serif": "激しくなる抽挿にも耐え、さくらは膣に力を入れる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "淫液に溢れ、蕩けきったさくらの蜜肉が締め付けを伴うと、背後の男はたまらず声をあげた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "村人１００", "Serif": "も、もう無理だっ、あっ、イッちまう……！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "井河さくら", "Serif": "あんたも、一緒にイクんだよっ、んっ、んん……ぷ、はぁ……っ", "Motion": 1, "Voice": "c_1703_1_033_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "", "Serif": "正面でひたすら乳房を愛撫していた男に対しても、わずかに生まれた隙を狙い、さくらは男の肉茎めがけて、唾を垂らす。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "", "Serif": "先走りに濡れていた男のペニスに見事的中し、それはびくんっ、と跳ねた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "井河さくら", "Serif": "ほらぁっ、はぁっ、私の身体でっ、ふたりともイッてぇぇっ！　オチンポ、イッちゃって、いやらしいザーメンたっぷり出しなよっ！", "Motion": 2, "Voice": "c_1703_1_034_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 45, "Name": "村人９９", "Serif": "うあああっ……！？", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 46, "Name": "", "Serif": "目にも止まらない速さで、瞬間的に繰り出すさくらの蹴り。それは絶妙な力加減で、さくらの太ももを正面の男のペニスにこすりつけた。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 47, "Name": "", "Serif": "その刺激にたまらず射精する男。次いで、背後の男も耐えきれずにさくらの蕩けきった膣内に射精し――", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 48, "Name": "井河さくら", "Serif": "んんんふぁああああぁぁぁぁああぁぁ――っっ！！！！", "Motion": 1, "Voice": "c_1703_1_035_1703", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 49, "Name": "井河さくら", "Serif": "あっ、あふぁああっ！？　熱いの、流れ込んで、きてぇっ、はぁっ、いっぐぅうぅううぅぅうぅぅう！！", "Motion": 1, "Voice": "c_1703_1_036_1703", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 50, "Name": "", "Serif": "射精の熱量に呼応して、さくらもまた絶頂したのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "耐えに耐えたさくらの内なる牝の本能が暴発し、射精のように愛液を飛び散らせる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 52, "Name": "井河さくら", "Serif": "はぁ、んっ、んはぁ……最後の最後、イカされはしたけど……あんたがイクのが先だったよね。あんたの射精のせいで、私はイッたんだから……", "Motion": 1, "Voice": "c_1703_1_037_1703", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 53, "Name": "井河さくら", "Serif": "対魔忍の実力、ちゃんと理解できた……？　んん、んはぁ……！", "Motion": 1, "Voice": "c_1703_1_038_1703", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 54, "Name": "", "Serif": "男たちはその凄絶な戦いぶりに、ただ平伏するほかなかった……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217032: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "", "Serif": "じゅるり、という粘ついた音が耳元すぐで聞こえる。さくらは嫌悪感に顔をしかめ、自身を拘束する『それ』を睨みつけた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "井河さくら", "Serif": "くっ……なんなの、これっ！　なんで、こんなもん作ってんの？　どういう使いみちがあるって……んっ、くうっ！？", "Motion": 1, "Voice": "c_1703_2_018_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "", "Serif": "さくらが進んだ分かれ道の先には、触手型の魔物が待ち受けていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "", "Serif": "と言っても、洞窟の道中に檻や拘束具もなく、好き放題に伸び切った数多くの触手を見る限り、組織の管理下ではなく捨て置かれた個体のようだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "井河さくら", "Serif": "私の経験上、こういうのは野生化するほど獰猛だったりするんだよね……！　それと、もうひとつ……経験からわかるのは……", "Motion": 1, "Voice": "c_1703_2_019_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "何本もの触手が這い回り、そして、戦闘服に吸い付く。次の瞬間には、強い力で引っ張られて戦闘服は破られてしまった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "", "Serif": "丈夫な素材とは聞いているが、負荷をかければ当然破れるだろう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "井河さくら", "Serif": "やっぱりね……この、エロモンスターが……！", "Motion": 1, "Voice": "c_1703_2_020_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "自らの股間に忍び寄る触手の影に、さくらは舌打ちするのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "井河さくら", "Serif": "こんの……んっ、んぐぅっ、ちょっとは濡らしてから挿れようとか、そういう考えができるようにっ、進化してよね……！　んっ、あぁっ、んんぐぅううぅっ！", "Motion": 1, "Voice": "c_1703_2_021_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "井河さくら", "Serif": "あ、あ、んんぎいいいぃぃぃぃいっ！！　思ったよりっ、はぁっ、太いぃっ！！　あぐぅうっっ、だめ、裂けちゃううぅうっ、オマンコ切れちゃうからぁあっ！", "Motion": 1, "Voice": "c_1703_2_022_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 12, "Name": "", "Serif": "さくらの諫言を聞き入れたわけではないだろうが、触手は先端から粘液を分泌して触手自身を濡らしながら、ぐいぐいとさくらの陰裂を責める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "", "Serif": "粘液のおかげで摩擦の痛みからは逃れられたが、しかし、その質量故の圧迫感は増すばかりだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "井河さくら", "Serif": "んんっっくうううぅっ！！　覚えてなさいよっ、後で絶対、ズタボロにしてやるんだからっ、んぐぅっ、んぁあああぁぁっ！", "Motion": 1, "Voice": "c_1703_2_023_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "", "Serif": "この局地戦では勝算を見いだせそうになかったが、最終的には異変に気づいてアサギたちがこちらへ来るはず。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "", "Serif": "さくらが拘束されたのは不意打ちもあってのことだ。既に相手が姿を現したこの状況で、アサギが不覚をとることはない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "井河さくら", "Serif": "はぁっ、んっっぐうぅううっ！　お姉ちゃんが来るまで耐えるだけ……！　それくらいっ、はぁっ、私なら余裕でっ、んっんんううぅううぅっ！！", "Motion": 1, "Voice": "c_1703_2_024_1703", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "触手はさくらの身体を、局部だけでなく全身を這い回り始める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "胸の膨らみに沿って揉みしだくような動き、或いは腋をぞりぞりと這い回るような動き。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "井河さくら", "Serif": "んんっ……はぁっ、くぁあああぁぁっ、こんな、気持ち悪いやつに、身体弄られてっ……んんああぁっ、感じるとでも、思ってんの……！？", "Motion": 1, "Voice": "c_1703_2_025_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 21, "Name": "井河さくら", "Serif": "んんぅうっ、はぁっ、あっ、こんなもん、作り出したやつの、顔が見てみたい……はぁっ、んんぅっ、見た瞬間、ビンタすると思うけどっ、はぁっ、んくぅっ", "Motion": 1, "Voice": "c_1703_2_026_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "ふと、局部の触手が動きを止める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "それまで淡々と膣内を探っていたそれは、膣内に入っている部分だけが急に膨張しはじめた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 24, "Name": "井河さくら", "Serif": "なっ、んんんぁああぁぁあぁ！？　ナカでっ、んぁっ、んんぐぉおっ、私のオマンコのナカでっ、いきなりっ、太く、なってぇえええぇぇっ！？", "Motion": 1, "Voice": "c_1703_2_027_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "そして……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "", "Serif": "膨張した触手は激しく抜き挿しを始め、拡がりきったさくらの秘裂を容赦なく突く。これまで以上に大量の粘液を分泌してはいるが、当然さくらのダメージは計り知れない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "井河さくら", "Serif": "んんぁあああぁっ！？　んぎっ、ぎぃっ、んんっっくうぅう！　あっ、だめ、はげし、すぎるぅううぅっ！！", "Motion": 1, "Voice": "c_1703_2_028_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "井河さくら", "Serif": "あぐ、わたしのオマンコっ、こわれ、ちゃうっ……！？　ぐちゃぐちゃに、なって、はぁっ、こわれちゃう、ってぇ……！", "Motion": 1, "Voice": "c_1703_2_029_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "", "Serif": "膣道には１ミリの隙間もないのではないかと思うほど、拡がりきっているように思えた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "粘液があるとは言え、そんな密度の中で激しく抜き挿しされれば、肉襞への摩擦で膣内はどんどん熱を持っていく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "井河さくら", "Serif": "んんんぁああぁっ、オマンコ、あついぃぃいっ、はぁっ、じんじん、するっ、はぁっ、とおりこしてぇ、ひりひりするぅううぅ……っ！", "Motion": 1, "Voice": "c_1703_2_030_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "", "Serif": "痺れるような感覚は、痛みと、違和感、嫌悪感に繋がる。さくらはその苦痛に顔を歪めて必死に耐える。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "", "Serif": "理性や知能のない触手型魔物だからこそ、容赦なく、躊躇なくさくらの秘部を犯していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "井河さくら", "Serif": "んぐぉっ、おふぅっ、こんなバケモノに犯されてっ、感じるわけ、ないっ……んっ、んんぐうぅっ、んんふううぅっ！！", "Motion": 1, "Voice": "c_1703_2_031_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "井河さくら", "Serif": "でも……きもちよく、なれたら……まだマシ、だったのかも……はぁっ、あっ、んふぅ、あたま、もうくらくら、してぇ……", "Motion": 1, "Voice": "c_1703_2_032_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "実際には、触手はさくらの牝を適確に刺激していた。また、彼女の肉花も蜜を垂らしている。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "", "Serif": "だが、それをさくらが性感だと自覚するには、あまりにも圧力が強すぎた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "井河さくら", "Serif": "も、だめ、はぁっ、こんなに拡げられて、はぁ、ぐちょぐちょに犯されて……オマンコ、もう、壊れちゃってる……！", "Motion": 1, "Voice": "c_1703_2_033_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "井河さくら", "Serif": "あ、あぁうっ！？　んぁうっ、なんか、きちゃうっ！？　はぁあああっ、からだ、あつく、なってぇ……！？", "Motion": 2, "Voice": "c_1703_2_034_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "", "Serif": "感じていると自覚はなくても、刺激を重ねれば、身体は勝手にオルガスムに達してしまう。意識とのギャップに戸惑いながら、さくらは身体を痙攣させ始める。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "井河さくら", "Serif": "んんぁぁぁあぁああぁぁ！？　な、なにっ、わたしの、からだ、どう、なって……あぐぅううっ、んっ、んんぁああっ！", "Motion": 2, "Voice": "c_1703_2_035_1703", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "井河さくら", "Serif": "ああああああっ、だめぇっ、ほんとに、こわれちゃうっ！　オマンコもっ、頭もっ、おかしくなって、はぁっ、あぁっ、んふぁああああぁぁぁあぁ――！？", "Motion": 1, "Voice": "c_1703_2_036_1703", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 43, "Name": "", "Serif": "激しく身体をのけぞらせようとするさくら。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 44, "Name": "", "Serif": "触手に拘束されながらも、動かせる範囲でさくらは全身をひくつかせた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 45, "Name": "井河さくら", "Serif": "あ、あああふぁあ……なんか、撃ち込まれたぁ……ザーメンみたいなの……最悪、なんだけど……", "Motion": 1, "Voice": "c_1703_2_037_1703", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 46, "Name": "", "Serif": "触手が秘裂から引き抜かれると、拳も入りそうなほど拡がった膣口から、白濁がどろりと流れ出した。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 47, "Name": "井河さくら", "Serif": "だ、だいじょうぶ……これで落ち着くでしょ……あとはお姉ちゃんが来るまでなんとか……意識を……", "Motion": 1, "Voice": "c_1703_2_038_1703", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 48, "Name": "", "Serif": "だが。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 49, "Name": "", "Serif": "激しい陵辱で感覚が麻痺しはじめていた陰部、そのすぐ近くを触手がなぞり始めたのをさくらは感じ取る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 50, "Name": "井河さくら", "Serif": "う、そぉ……お尻の穴は……無理、だってばぁ……はぁ、ああぁうぅうっ！？", "Motion": 1, "Voice": "c_1703_2_039_1703", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "その後、合流したアサギたちに救出されてから、さくらはこの洞窟に火をかけ、念入りに触手を焼き払ったのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217041: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "", "Serif": "目の前のゴブリンを殴りつけ、怯ませたアスカ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "しかし、隠れていたもう１体が彼女の足元に抱き着いてきた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "甲河アスカ", "Serif": "しまっ……もう、一匹いたの？", "Motion": 1, "Voice": "c_1704_1_022_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "", "Serif": "草むらに倒れ込んだアスカが、すぐに身を起こそうとする。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "", "Serif": "それを、ゴブリンが上から抑えつけた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "小柄ではあるが、力はかなり強い。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "甲河アスカ", "Serif": "くっ……どきなさい……ちょっ、こらっ！", "Motion": 1, "Voice": "c_1704_1_023_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "", "Serif": "その気になれば訳もない敵である。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "しかし、彼女の中にある迷いが反応を遅れさせた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "", "Serif": "その瞬間、ゴブリンが彼女のスーツを引き裂いた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "甲河アスカ", "Serif": "な……何を？　ちょっと！私はあなたのお母さんじゃ……くっ……", "Motion": 1, "Voice": "c_1704_1_024_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "", "Serif": "露わになったアスカの豊かな胸に、ゴブリンがむしゃぶりつく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "", "Serif": "そして、殴られた方のゴブリンも立ち上がるとゆっくりとアスカに近付いてきた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "甲河アスカ", "Serif": "いい加減に……しな……さい。本当に怒る……んああっ！", "Motion": 1, "Voice": "c_1704_1_025_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 15, "Name": "", "Serif": "乳房を吸うゴブリンを睨みつけたアスカの下腹部に激痛が走った。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "甲河アスカ", "Serif": "ちょっと！　何を！？まさか……あなた……ちょ、ダメっ！", "Motion": 1, "Voice": "c_1704_1_026_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "", "Serif": "隆起した異形の男根を、ゴブリンが彼女の秘裂に突き立てた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "子供とは思えない、その大きさにアスカの顔が苦悶に歪む。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "甲河アスカ", "Serif": "（違う……甘えてるんじゃない……。こいつら……魔物のくせに人間と交配しようっていうの……）", "Motion": 1, "Voice": "c_1704_1_027_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "甲河アスカ", "Serif": "殺すっ！", "Motion": 1, "Voice": "c_1704_1_028_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "", "Serif": "所詮は魔物。情けは不要と、アスカが荒い息の中で覚悟を決めようとした瞬間だった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "彼女は、ゴブリンの目に浮かんだ雫を見た。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "甲河アスカ", "Serif": "くっ……な……何よ、それ？泣いてるの？　私が親の仇だから……これが……ああっ……復讐だとでも……言うの？", "Motion": 1, "Voice": "c_1704_1_029_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "", "Serif": "それが本当に魔物の涙だったのか。真相は分からない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "そもそも目の前のゴブリンが本当に子供かどうかも、アスカがそう思った、というだけのことで事実ではないかもしれない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 26, "Name": "", "Serif": "しかし、それを涙と見てしまった彼女の戦意は大きく挫かれた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 27, "Name": "", "Serif": "家族を殺された苦しみ、憎しみは彼女がよく知っていたからである。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 28, "Name": "甲河アスカ", "Serif": "あっ……いい……わ。やりなさいよ……それで気が済むなら……あっ……ぐっ……", "Motion": 1, "Voice": "c_1704_1_030_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "", "Serif": "振りかぶった右腕を降ろす。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "しかし、ゴブリンらはそんな彼女の心情を知らぬままに、その欲望をただぶつけるのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "", "Serif": "力の限り吸い込まれた彼女の乳房が鬱血する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "", "Serif": "その乳頭を、長いザラザラした舌が執拗に舐め回す。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "甲河アスカ", "Serif": "いっ……痛いのに……、魔物なんかに舐められて……あっ……あふっ……き……気持ちいい……わけ……", "Motion": 1, "Voice": "c_1704_1_031_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "", "Serif": "声を殺し、アスカが漏れ出そうな吐息を堪える。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "", "Serif": "その気になればいつでも殺せる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "ただ、甘んじて復讐を受けてやる。そのつもりだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "甲河アスカ", "Serif": "あっ……くっ……ダメ……こんな……感じちゃったら……魔物なんかに……それも子供に犯されて……気持ちいいなんて……", "Motion": 1, "Voice": "c_1704_1_032_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "", "Serif": "自分の心の平静を保とうと、口に出す。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "しかし、その言葉とは裏腹に、弾んだ呼吸には女の肉欲の片鱗が混ざっていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "甲河アスカ", "Serif": "あっ……大きい……お、奥にグリグリ当たって……私のお腹の中で……暴れまわって……あぐぅ……", "Motion": 1, "Voice": "c_1704_1_033_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "", "Serif": "太く長いゴブリンの肉棒が、彼女の膣内で暴れまわる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "", "Serif": "苦痛とともに快感が突き上げてくる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "甲河アスカ", "Serif": "ダメ……これはあくまで……。でも……こんな……ゴブリンのチンポで……そんなの……", "Motion": 1, "Voice": "c_1704_1_034_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "", "Serif": "身体が反応を示しながらも、意識はまだ快楽を拒絶していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 45, "Name": "", "Serif": "そんな彼女の葛藤を知ってか知らずか、ゴブリンの腰の動きが加速する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 46, "Name": "甲河アスカ", "Serif": "あああああっー！　ダメ……ダメっ！子宮ッ……壊れっ……あぐぅ……ひぎいいいぃぃっ！？", "Motion": 1, "Voice": "c_1704_1_035_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 47, "Name": "", "Serif": "子宮を貫くような衝撃に、アスカは慌てて身体をずり上げようとする。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 48, "Name": "", "Serif": "だが、その身体をゴブリン２体ががっちりと抑え込む。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 49, "Name": "甲河アスカ", "Serif": "い……痛いっ……ダメ……ダメっ！ああっ……あぐっ……はひぃ……私のおまんこ壊れ……はぐぅっ！", "Motion": 1, "Voice": "c_1704_1_036_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 50, "Name": "", "Serif": "痛みを抑えるのは快感しかない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "こうなった以上、彼女はその本能に身を委ねるしかなかった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 52, "Name": "甲河アスカ", "Serif": "アひぃっ！　ゴブリンのチンポ……しゅごい……おっきい！はああああっンン！　おまんこ滅茶苦茶になっちゃうのぉおおお", "Motion": 2, "Voice": "c_1704_1_037_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 53, "Name": "", "Serif": "口元から涎を垂らし、その瞳が妖しく濡れる。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 54, "Name": "", "Serif": "そこに映ったゴブリンの顔が歪んだ。絶頂が近いことは明らかだ。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 55, "Name": "甲河アスカ", "Serif": "イクのっ？　私のおまんこの中に……ゴブリン精子を出すの？ああっ！　おまんこに精子……いっぱい出されちゃうっ！　あアああっーッ！", "Motion": 2, "Voice": "c_1704_1_038_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 56, "Name": "甲河アスカ", "Serif": "ああああぁぁああぁっ！？　出てるっ、出てるのぉぉおおぉっ、んんふぁああぁぁあぁっ！", "Motion": 1, "Voice": "c_1704_1_039_1704", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 57, "Name": "", "Serif": "膣内で肉棒が激しく脈打ち、精を放った。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 58, "Name": "", "Serif": "堰を切ったような奔流が、彼女の中になだれ込む。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 59, "Name": "", "Serif": "溢れ出た精液が、地面を濡らす。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 60, "Name": "", "Serif": "しかし、ゴブリンの陰茎は萎縮するどころか、アスカの膣に栓をするかのように膨張したままだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 61, "Name": "甲河アスカ", "Serif": "あフぅ……まだデキるの？はぁああ……ゴブリンチンポ……すごい……", "Motion": 1, "Voice": "c_1704_1_040_1704", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 62, "Name": "", "Serif": "彼らの欲望を全て受け入れたら自分はどうなるのか。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 63, "Name": "", "Serif": "恐怖よりも、好奇が勝る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 64, "Name": "", "Serif": "しかし、暗闇に彼女を呼ぶ声が、そんなアスカの思いを断ち切った。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 65, "Name": "", "Serif": "ピュルテと、アサギの声も聞こえる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 66, "Name": "", "Serif": "アスカがこの姿を見れば、アサギは躊躇する事無くゴブリンらを殺すだろう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 67, "Name": "甲河アスカ", "Serif": "御免ね……大きくなったらおいで。その時は、対魔忍として相手してあげるから……", "Motion": 1, "Voice": "c_1704_1_041_1704", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 68, "Name": "", "Serif": "その直後、アスカは当て身でゴブリン２体をあっさりと気絶させると、声のする方角に戻って行った。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217042: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "職人１", "Serif": "腕だぁ？　俺ぁ、こっちの方が見たいがね！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "伸ばしたアスカの腕を引き、男がアスカの身体を抱き寄せる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "甲河アスカ", "Serif": "ちょっと何よ？　止めてよ、気持ち悪い！", "Motion": 1, "Voice": "c_1704_2_014_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "職人１", "Serif": "何言ってやがる。こんなエロい服を着ておいてよ。身体で払ってくれよ。なぁ、こっちは生身なんだろ？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "", "Serif": "男の右腕が下腹部に伸びる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "倒そうと思えば簡単だが、それでは代金を踏み倒す事になる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "", "Serif": "アスカのその迷いを男らは感じ取った。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "職人２", "Serif": "へへっ、悪い話じゃねぇだろ。俺らも気持ちいい……お前さんも気持ちよくなって、代金も払わずに済むんだ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "甲河アスカ", "Serif": "（流石に一般人を手にかけるわけには……でも……だからと言ってこんな……くっ……）", "Motion": 1, "Voice": "c_1704_2_015_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "", "Serif": "男の指が、スーツの上から敏感な割れ目を刺激する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "", "Serif": "じんわりと滲んだ愛液が、生地にシミを作る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "", "Serif": "男らに為されるがままに、アスカは寝室に連れ込まれた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "", "Serif": "四つん這いになった彼女の上下の口を、それぞれ男らの肉棒が塞ぐ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "職人１", "Serif": "おっ……おおっ、やっぱりおまんこは生身に限るぜ。中のヒダヒダがチンポに絡みついて来やがる……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 15, "Name": "甲河アスカ", "Serif": "ひぁっ……そんな事……言われても……別に私は……そんなつもりじゃ……", "Motion": 1, "Voice": "c_1704_2_016_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "甲河アスカ", "Serif": "んんんぅううぅっ、んっ、くううっ！？　動くと、擦れてっ、はぁっ、んぁあああっ！", "Motion": 1, "Voice": "c_1704_2_017_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "", "Serif": "男がゆっくりと腰を動かす度に、その太い陰茎が膣壁に擦れる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "溢れだした愛液が、彼女の意志とは関係なく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "それを奥へ奥へと誘っていく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "職人２", "Serif": "ほら……こっちも休んでんじゃねぇぞ。口でしっかりメンテナンスしてくれや。そうそう、たっぷり唾液で濡らしてよぉ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "甲河アスカ", "Serif": "ん、はぁ……っ、あふぁ、これを口で……？　なによ、この大きさ……", "Motion": 1, "Voice": "c_1704_2_018_1704", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "舌の上に男の硬くて太いモノが乗ると、自然と口内を唾液が満たす。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "それが、まるで機械に油を差したかのように、男の肉棒を滑らかに口の中に運び込む。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "甲河アスカ", "Serif": "むぐっ……はむっ……大きくて息ができない", "Motion": 1, "Voice": "c_1704_2_019_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "口の中に無造作に突き立てられる肉塊が軌道を塞ぐ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "", "Serif": "その盛り上がった亀頭を舌で押しのけ、アスカがようやく息をつく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "職人２", "Serif": "そうだ。亀頭も竿も舐めるんだよ。やっぱ……こんな身体してんだ。男を悦ばすのはお手の物だろうぜ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "甲河アスカ", "Serif": "調子に乗らないでよね……っ、んぅっ、ふうっ、私が本気でやろうと思えば……んんむううぅっ！？", "Motion": 1, "Voice": "c_1704_2_020_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "", "Serif": "男の手がアスカの頭を抑え付け、再び口を塞ぐ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "蒸れた臭いが空気とともに鼻腔に入り、アスカはむせ返りそうになりながらも首を動かした。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "甲河アスカ", "Serif": "あっ……はっ……はぁん……ん、んんっ……あぁっ……", "Motion": 1, "Voice": "c_1704_2_021_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "", "Serif": "パンパンと乾いた音が臀部から響き、ズポズポと口が鳴る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "", "Serif": "短く呻くアスカの声が次第に淫らな音色を奏で始めた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "職人１", "Serif": "乗ってきたじゃねぇか。そうだよ。もう、チンポぶち込まれてるんだ。どうせヤラれるんなら、楽しんだ方が得ってモンだぜ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "", "Serif": "彼女のじっとりと汗ばんだ肌から、甘い色香が立ち上る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "それが男たちの肉欲をさらに刺激し、激しい行為となってアスカを責め立てる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "甲河アスカ", "Serif": "んんっ……あふっ……チンポがズボズボ入ってくるぅ……お口もおまんこも……気持ちいいのぉ……", "Motion": 1, "Voice": "c_1704_2_022_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "", "Serif": "彼女の鍛え上げられた肉体は、男たちの欲望を十分に受け止められた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "そして、その余裕が彼女の中の情欲をさらに駆り立てていく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "甲河アスカ", "Serif": "もっと……チンポ……奥をゴリゴリ抉って欲しいのぉ！はむっ……じゅぽっ……チンポ美味しい……", "Motion": 1, "Voice": "c_1704_2_023_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "甲河アスカ", "Serif": "んんぅうっ、んっ、じゅるっ、ずじゅっ、じゅじゅるっ、じゅちゅっ、んふぁああっ、はぁっ、はぁむぅっ、んぅっ、んじゅ、じゅちゅるるるっ", "Motion": 1, "Voice": "c_1704_2_024_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "", "Serif": "腰を自らくねらせながら、アスカが口をすぼめ陰茎を吸い込む。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "", "Serif": "頬がへこむ程に咥え込むと、ズズズと淫靡な音を立てる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "職人２", "Serif": "くっ……すげぇ吸引だ……何だよコイツ……商売女でもこんなフェラできねぇよ……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 45, "Name": "職人１", "Serif": "こっちもグイグイ締め付けてきやがる……。うっ……絞り取られるみてぇだ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 46, "Name": "甲河アスカ", "Serif": "んんふううぅっ、はぁっ、そうでしょ……私がこれまで、んっ、どれだけ経験してきたか……はぁっ、身を持って教えてあげるわ……", "Motion": 1, "Voice": "c_1704_2_025_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 47, "Name": "甲河アスカ", "Serif": "アームレッグだけじゃなくて、んっ、はぁっ、生身の私の技術も、体感しなさいよねっ、んっ、はぁっ", "Motion": 1, "Voice": "c_1704_2_026_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 48, "Name": "甲河アスカ", "Serif": "わかったらっ、あぁっ、ああああんんっっ！！　ちゃんと、そのチンポでっ、んっ、あっ、私のおまんこ、満足させなさいよ……！！", "Motion": 1, "Voice": "c_1704_2_027_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 49, "Name": "", "Serif": "性の愉悦に身を投じたアスカの身体は、その全力でもって快感を貪った。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 50, "Name": "", "Serif": "その絶技に掛かった男たちの衝動は一気に絶頂へと達する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 51, "Name": "甲河アスカ", "Serif": "あああはあああああぁぁぁっ！？　口のなかっ、おまんこのナカっ、どっちもっ、膨らんでっ、はぁっ、んんむううっ、んじゅるっ、じゅっ", "Motion": 2, "Voice": "c_1704_2_028_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 52, "Name": "職人１", "Serif": "ダメだ……もう我慢できねぇ！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 53, "Name": "", "Serif": "そのエロい身体にしっかり精液注入してやるぜ！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 54, "Name": "職人２", "Serif": "ああっ！　しっかり受け止めやがれ。イク……イクぞっ！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 55, "Name": "甲河アスカ", "Serif": "頂戴！　ザーメン……エッチなアスカのおまんことお口にたっぷり注いで欲しいのぉ！", "Motion": 2, "Voice": "c_1704_2_029_1704", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 56, "Name": "甲河アスカ", "Serif": "んんうぅうっぅぅぅぅっ！？　んじゅ、んぶっ、んふぅ……", "Motion": 1, "Voice": "c_1704_2_030_1704", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 57, "Name": "", "Serif": "前後の男たちが、雄叫びとともに精を放出する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 58, "Name": "", "Serif": "アスカは口内に発射された精液に息苦しさを感じつつ、怒涛のようになだれ込んでくる白濁液に、呼応する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 59, "Name": "甲河アスカ", "Serif": "あ、あはぁ……私もイっちゃった……ザーメンいっぱい入れられて私も……イッちゃって……あっ、またっ、ああんっ！", "Motion": 1, "Voice": "c_1704_2_031_1704", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 60, "Name": "", "Serif": "脳内に電流が走ったような衝撃を受けながら、アスカは何度も寄せては返す波のような絶頂に、びくびくと身を震わせ続ける。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 61, "Name": "甲河アスカ", "Serif": "はぁ……はぁ……ザーメンで私の身体……すごくエッチにされちゃったの……", "Motion": 1, "Voice": "c_1704_2_032_1704", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 62, "Name": "", "Serif": "快楽の余韻に耽るアスカの肢体に、玉のような汗が輝く。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 63, "Name": "職人１", "Serif": "へへっ……何ならこれからのメンテナンス代は毎回、コレで払ってくれてもいいんだぜ……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 64, "Name": "", "Serif": "犯したのは彼らの側だが、その声にはどこか虚勢が混じっていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 65, "Name": "", "Serif": "身体を交えたからこそ、眼下の女が常人ではない事が分かったのである。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 66, "Name": "甲河アスカ", "Serif": "調子に乗らないで……条件はさっき言ったとおり。それともこんなギミックもお望みかしら？", "Motion": 1, "Voice": "c_1704_2_033_1704", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 67, "Name": "", "Serif": "クスリと笑ったアスカの右腕から、対魔ブレードが飛び出る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 68, "Name": "", "Serif": "その冷たい光に、男たちの肉棒はあっという間に萎縮するのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217051: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "", "Serif": "アサギたちが特殊な任務についているとは聞いていたが、まさか異世界に来ているとは予想していなかったふうま小太郎。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_44", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "しかし、実際にこうして彼自身も来てみると、元の住み慣れた世界とそう大差ないように感じるのだった。湖面の輝きも、周囲の木々の匂いも。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "ふうま小太郎", "Serif": "ま、一番代わり映えしないのは、きらら先輩が隣にいるってことですかね", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "鬼崎きらら", "Serif": "はああ？　あっそう、面白みのない風景で悪かったわね。だったらもう、私は行くわ。話すことは全部、話したし", "Motion": 1, "Voice": "c_1705_1_023_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "", "Serif": "情報共有、という建前で事の顛末を聞かせてくれたきららだが、終盤になると敵の策略に落ちた後悔を延々と繰り返していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "だいぶ気にしているのは明らかだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "ふうま小太郎", "Serif": "まだ話は終わってませんよ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "鬼崎きらら", "Serif": "え……？　ちょ、ちょっと、なに急に手なんかつかんでっ、放しなさいってば、んっ、んんぅううっ？", "Motion": 1, "Voice": "c_1705_1_024_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "強引に唇を奪い、そのまま押し倒して愛撫を繰り返すふうま。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "", "Serif": "脱がせながら、屹立を陰裂に押し当てれば、きららは緊張した面持ちで彼を見つめる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "鬼崎きらら", "Serif": "ね、ねえ、本当にこんなところでするの？　思いっきり外だし、昼間だし、誰に見られるかわかんないでしょ", "Motion": 1, "Voice": "c_1705_1_025_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "ふうま小太郎", "Serif": "きらら先輩はこういうところでした経験、ないんでしたっけ。大丈夫ですよ、案外誰も来ないですから", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "鬼崎きらら", "Serif": "べ、別にっ、屋外でした経験くらい、あるけどっ！？　って、んんっ、あっ、やっ、入ってきて……あああんっっ！！", "Motion": 1, "Voice": "c_1705_1_026_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 14, "Name": "鬼崎きらら", "Serif": "し、信じらんないっ、なんでこんなにっ、ガチガチにさせてるのよっ、んっ、あああんっ！！", "Motion": 1, "Voice": "c_1705_1_027_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "ふうま小太郎", "Serif": "だって……きらら先輩が元気なさそうだったんで……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "鬼崎きらら", "Serif": "私が元気ないと、あんたはここが勃つわけ！？　最低なんだけど！", "Motion": 1, "Voice": "c_1705_1_028_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "ふうま小太郎", "Serif": "じゃなくて、元気ないきらら先輩見てたら……すごく、可愛いというか、守ってあげたい、元気づけてあげたいって思えて……そんなこと考えてたら、股間が……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "きららのツッコミに対して回答になっているような、なっていないような、微妙な受け答えをするふうま。しかし、きららには充分、効果的だった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "鬼崎きらら", "Serif": "（は……はああ？　な、なによそれっ、私のこと……操られて情けないとか、そんなんじゃなくて、元気づけたいなんて、そんなふうに思って……？）", "Motion": 1, "Voice": "c_1705_1_029_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "ふうま小太郎", "Serif": "くうっ、だ、だめですよ、きらら先輩。そんなに締め付けたらっ、うっかり出ちゃいますから……！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "鬼崎きらら", "Serif": "はあっ……んっ……そんなの、許さないん、だからっ……はぁっ……んっ、ふうぅっ……", "Motion": 1, "Voice": "c_1705_1_030_1705", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "鬼崎きらら", "Serif": "ああっ……そんなにっ……強く、掴まれたらっ……！　あっ、ああんっ……！", "Motion": 1, "Voice": "c_1705_1_031_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "ふうまが手首を引きながら抽挿するので、きららからするとより密着感が増しているように感じられた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 24, "Name": "ふうま小太郎", "Serif": "よかった、きらら先輩、元気になってきたみたいですね", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "鬼崎きらら", "Serif": "元気って、何を根拠にそんなこと言ってんのよっ……んっ、ふうううっ、んうっ、あぁんっ、んんっ！", "Motion": 1, "Voice": "c_1705_1_032_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "ふうま小太郎", "Serif": "だって顔の血色も良くなって……それに、なんか、嬉しそうに見えるし……！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "鬼崎きらら", "Serif": "う、うれしいとかっ、そんなはず、んんっ、あんっ、な、ないでしょっ、あああっ！", "Motion": 1, "Voice": "c_1705_1_033_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "鬼崎きらら", "Serif": "こんなことしてたらっ、んっ、ああっ、血色が良くなるのも、当然だしっ、んっ、あっ、あんっ！", "Motion": 1, "Voice": "c_1705_1_034_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "ふうま小太郎", "Serif": "俺で、感じてくれてるんですね。その顔、すごく可愛いです……！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "決定的なふうまのセリフに、きららの顔はいよいよ赤みを増していく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "鬼崎きらら", "Serif": "ば、ばかっ、恥ずかしいこと言わないでってば……！　んんっ、はぁっ、あんっ、あああっ！", "Motion": 1, "Voice": "c_1705_1_035_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "鬼崎きらら", "Serif": "だめ、深い……っ、ああっ、あんたのが、私のっ、奥にっ、んんっ、当たっちゃってるっ……！", "Motion": 1, "Voice": "c_1705_1_036_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "鬼崎きらら", "Serif": "はぁっ、あっ、だめ、これ以上されたら、もう、わたしっ、んっ、はぁんっ！　あ、あああ、ああああんっ！！", "Motion": 2, "Voice": "c_1705_1_037_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "", "Serif": "身を震わせるきらら。それに応じて、膣肉も激しくうねる。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "", "Serif": "ふうまもまた、その刺激に耐えきれず――", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "ふうま小太郎", "Serif": "くううっ、先輩、もう限界ですっ、このまま出して、いいですよねっ？", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "鬼崎きらら", "Serif": "あはああああっ！？　んっ、あっ、あぁんっ！　もう、なんでもいいからっ、はぁっ、好きにしてっ、あっ、あああんっ！", "Motion": 2, "Voice": "c_1705_1_038_1705", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "", "Serif": "押し寄せる快楽に、きららはついに考えることさえ放棄して――", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "鬼崎きらら", "Serif": "ああああぁぁぁぁっっ！？　やっ、出てるぅううっ！？　熱いの、いっぱい、出て……！　はぁっ、あっ、あんっ！", "Motion": 1, "Voice": "c_1705_1_039_1705", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 40, "Name": "", "Serif": "たっぷりと射精されたきららは、ぐったりと脱力する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 41, "Name": "ふうま小太郎", "Serif": "きらら先輩が可愛くて、つい大量に出し過ぎちゃいました", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 42, "Name": "鬼崎きらら", "Serif": "だ、だからっ、もう……！　そういうこと言うなって言ってんでしょ……！", "Motion": 1, "Voice": "c_1705_1_040_1705", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 43, "Name": "鬼崎きらら", "Serif": "嬉しいこと……言わないでよね……また、したくなっちゃうんだから……", "Motion": 1, "Voice": "c_1705_1_041_1705", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 44, "Name": "", "Serif": "最後にぽつりと漏らしたきららのつぶやき。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 45, "Name": "", "Serif": "ふうまは聞き返すが、きららは絶対にその口を割らなかったのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217061: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "水城ゆきかぜ", "Serif": "なんなの、この部屋。まあ、悪党のアジトにおしゃれな応接間を期待するほうが間違ってるとは思うけど……", "Motion": 1, "Voice": "c_1706_1_016_1706", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "アジトとされる場所に案内され、部屋に通されてからどれくらい時間が経っただろうか。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "", "Serif": "唐突に、ガシャン、という金属音とともに室内の至るところから空気の吹き出す音が聞こえ始めた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "水城ゆきかぜ", "Serif": "……っ！？　しまった、まさか毒ガス！？　くっ、やばっ、身体に、力が入らな……っ", "Motion": 1, "Voice": "c_1706_1_017_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "水城ゆきかぜ", "Serif": "ううん、違う……なにこれっ、はぁっ、身体が変っ……あっ、ああぁうっ！？", "Motion": 1, "Voice": "c_1706_1_018_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "気がつくと、股間からは愛液がとめどなく垂れている。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "水城ゆきかぜ", "Serif": "これは……媚薬……！？", "Motion": 1, "Voice": "c_1706_1_019_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "", "Serif": "部屋の扉が開くと、全裸にガスマスクといった出で立ちの男が入ってきた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "水城ゆきかぜ", "Serif": "ああっふぁあああんんんっっ！！　いいっ、おまんこの奥っ、当たってるぅっ、あぁっ、あんっ、んんぅうううっ！！", "Motion": 1, "Voice": "c_1706_1_020_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 10, "Name": "", "Serif": "たっぷりと催淫ガスを吸い込んでしまったゆきかぜが、男たちの蛮行に抵抗できるはずもなかった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "", "Serif": "またたく間に脱がされ、そして身体のあちこちを犯されて――", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "チンピラ１", "Serif": "さっきのナマイキな小娘が、見ろよ。俺の上でよがって腰振ってやがる", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "水城ゆきかぜ", "Serif": "こんなのっ、んっ、だめ、なのにっ……！　こんな奴らに、身体っ、許しちゃいけないって、わかってる、のにっ……！　あぁっ、んんぅううっ！", "Motion": 1, "Voice": "c_1706_1_021_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 14, "Name": "水城ゆきかぜ", "Serif": "わかってても、抵抗できないっ、んっ、あはああぁぁぁあぁっ！　身体が、勝手に、動いちゃうぅぅううぅっ、んはぁ、あっあっ、あああんっっ！", "Motion": 1, "Voice": "c_1706_1_022_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 15, "Name": "水城ゆきかぜ", "Serif": "だめって、わかってるのに、気持ちいいのっ！　はひぃいっ、ひぁんんっ！おまんこ、気持ちよすぎてぇえええっ、とまんないよぉっ、はぁああんっ！", "Motion": 1, "Voice": "c_1706_1_023_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 16, "Name": "チンピラ２", "Serif": "くぅっ、こいつエロすぎる……！　言われもしないのに、自分から俺たちのチンポを握ってきやがった！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 17, "Name": "チンピラ３", "Serif": "おい、だめだって！　後でおまえに挿れるのに、ここで手で抜かれたらっ、くっ、うううっ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "一人の男の上にまたがったゆきかぜは、両脇の男たちの肉竿さえも手にとり、しごき始めていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "華奢なその指先は、適確にカリの敏感な箇所をなぞり刺激する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 20, "Name": "水城ゆきかぜ", "Serif": "あっ、あんぅっ、あああっ！　だってぇっ、チンポ、見てるだけでぇっ、はぁっ、触りたくなっちゃうっ……！　こんなの、はしたないってわかってる、けどぉっ、でもっ、あんっ！！", "Motion": 1, "Voice": "c_1706_1_024_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 21, "Name": "水城ゆきかぜ", "Serif": "はぁっ、あっ、あんっ、チンポ持ってるだけで、はぁっ、興奮しちゃうぅぅうぅっ！！　こんな太いの、挿入ってきたらって、想像しちゃうのぉおおぉっ！", "Motion": 1, "Voice": "c_1706_1_025_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 22, "Name": "チンピラ１", "Serif": "おいおい、俺のチンポで満足してないかのような言いっぷりだな。ほら、これでどうだっ！！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "男は下から激しく突き上げる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 24, "Name": "", "Serif": "ちょうどゆきかぜが腰を沈めかけたタイミングでもあったため、男の切っ先がゆきかぜの膣奥を力強く叩いてしまう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "水城ゆきかぜ", "Serif": "んひぃいぃぃいぃいぃっ！？　あひぃ、んっ、それ、すごいっ、はぁあんっ！　おまんこの、いちばん、おくっ、あひぁあああっ！　ずんって、きたぁああぁっ！", "Motion": 1, "Voice": "c_1706_1_026_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "チンピラ１", "Serif": "どうだ、これで少しはこりたか。小娘のくせに、正義の味方ぶりやがって。怖いおじさんのチンポには逆らえないだろ！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "水城ゆきかぜ", "Serif": "んひいいぃいぅぅうっ！　んっ、うんっ、逆らえないっ、はぁっ、ぶっといおじさんチンポほしくてぇ、言うこと聞いちゃううぅうっ！", "Motion": 1, "Voice": "c_1706_1_027_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "", "Serif": "当初はまだ、性欲を制御できないながらも、これがいけないことだという意識が辛うじてあったゆきかぜ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "", "Serif": "だが、ガスの効果は行為の高まりとともに、彼女のそんな残された理性すらも壊し始めていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "水城ゆきかぜ", "Serif": "はひぃ、ひぁああんっっ！！　チンポ、しゅごぃいぃいっ、気持ち、いいっ、んうぅっ、んぐっ、んっ、あああぁっ、いいっ！", "Motion": 1, "Voice": "c_1706_1_028_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "チンピラ２", "Serif": "チンポに囲まれて、なんてだらしない顔してやがんだ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "チンピラ３", "Serif": "ナマイキで、まだ乳臭い小娘かと思ったが、なかなか牝の顔になってやがるな", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "水城ゆきかぜ", "Serif": "んはぁっ、はぁんっ、そうよっ、はぁっ、んっ！　わたし、だってぇ……立派な女なんだからぁ……胸は、小さくても、チンポの味も知ってるしぃ……", "Motion": 1, "Voice": "c_1706_1_029_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "水城ゆきかぜ", "Serif": "おまんこだってぇ、はぁっ、ちゃんとチンポ気持ちよく、できるんだからぁ……♪", "Motion": 1, "Voice": "c_1706_1_030_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "チンピラ１", "Serif": "そうまで言うなら、ちゃんと大人の女として、最後までチンポの面倒見てもらうぞ！　そら、これでどうだ！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "水城ゆきかぜ", "Serif": "はっひいいぃぃいいぃいんっっ！？　んなぁああああっ、しゅごいっ、しょれ、はぁうううぅうんっ！　あたまが、おかひく、なりゅっ、んんぁああっ！", "Motion": 2, "Voice": "c_1706_1_031_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "", "Serif": "絶頂を予感した男は、ひときわ強く、激しく、下から突き上げる。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "", "Serif": "その刺激にゆきかぜも膣内を強く締め付け、濡れた襞の抱擁に男はたまらなくなる。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "チンピラ１", "Serif": "出すぞっ、ちゃんとマンコの奥で受け止めろよ！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "水城ゆきかぜ", "Serif": "んふぁああっ、なんでっ、んはっ、わたひのおまんこっ、ザーメン出すって聞いただけで、ほしく、なってぇ……っ、ひくひく、しちゃうのぉっ！", "Motion": 2, "Voice": "c_1706_1_032_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "水城ゆきかぜ", "Serif": "あひぁあああっ、あっ、んんぅううっ、だひてぇっ、おねがいっ、なか、だひて、ほしいのぉおおぉっ！", "Motion": 2, "Voice": "c_1706_1_033_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "", "Serif": "そして最奥に狙いを定めるようにして――", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "チンピラ１", "Serif": "くううっ、出るっっ！！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "水城ゆきかぜ", "Serif": "あっひぃいいぃいいいいぃぃいぃ――っ！？　いぐっ、いぐぅううぅっ、イッくうううぅぅうううぅっ！！", "Motion": 1, "Voice": "c_1706_1_034_1706", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 45, "Name": "水城ゆきかぜ", "Serif": "はぁ、はぁっ、イッちゃったぁ……どうひよう……１本目のチンポでこんなにイッちゃって……", "Motion": 1, "Voice": "c_1706_1_035_1706", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 46, "Name": "", "Serif": "ゆきかぜは完全に理性を失った瞳で、両脇の男たちを見上げた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 47, "Name": "水城ゆきかぜ", "Serif": "んふーっ、んふーっ……もうこんなにイッちゃったのに、またおまんこにチンポ、ハメちゃったらぁ……ほんとに、おかひく、なっちゃいそ……", "Motion": 1, "Voice": "c_1706_1_036_1706", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 48, "Name": "水城ゆきかぜ", "Serif": "ねえ……チンポでわたしのおまんこぉ……こわしてみてぇ……？", "Motion": 1, "Voice": "c_1706_1_037_1706", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 49, "Name": "", "Serif": "ガスの効果が切れるまでの時間、４人は享楽の限りを尽くした。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 50, "Name": "", "Serif": "ぐったり倒れているところに、不審に思って様子を見に来た凜子に救出されるのだが――", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "目覚めたときの、ゆきかぜの自己嫌悪はひどいものだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217062: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "戦闘員", "Serif": "うるせえ、これでも食らいやがれ！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "水城ゆきかぜ", "Serif": "くっ！？　なにこれっ、コード？　んぅっ、身体に巻き付いて……っ。ちっ、ライトニングシューターっ！", "Motion": 1, "Voice": "c_1706_2_018_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "", "Serif": "男が放ったのは配線コードのような細長いものだった。身体に絡みつき、ゆきかぜの動きを一瞬、封じる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "", "Serif": "すぐにゆきかぜは。自身の雷撃でコードを取り除こうとした。だが……。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "水城ゆきかぜ", "Serif": "なっ、雷撃が効かない！？　どうしてよっ、くううっ、ライトニングシューター！", "Motion": 1, "Voice": "c_1706_2_019_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "戦闘員", "Serif": "無駄だ。何度やっても同じことだぞ。そしてそれは、俺に対しても同じ……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "水城ゆきかぜ", "Serif": "……ぁっ、後ろ！？　しまっ……くっ、ぐうううっ！", "Motion": 1, "Voice": "c_1706_2_020_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "", "Serif": "コードに注意を奪われたゆきかぜは、背後をとられてしまう。すかさず男は、ゆきかぜの身体を押さえつける。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "抵抗しようにも、コードが絡み思うように動けず、コードも男も雷撃をものともしなかった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "", "Serif": "男は容赦なく、ゆきかぜの戦闘服に手をかけ――", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "水城ゆきかぜ", "Serif": "や、やめてっ、んぁっ、あああぁぁぁあぁぁっ！？　いやあああっ、放しなさいってぇええぇっ！？　んぎぃぃいいいいぃっ！", "Motion": 1, "Voice": "c_1706_2_021_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 12, "Name": "", "Serif": "無残に破かれた股間部分に、男は躊躇なくそそり立つ肉棒を突き立てた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "", "Serif": "強引な闖入者に、ゆきかぜの膣襞は燃えるような刺激を受ける。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "戦闘員", "Serif": "雷撃の対魔忍、水城ゆきかぜ……その恐ろしさは、雷撃さえ対策を打てば半減する。俺も、そしてこの拘束も、ゴムでできている", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "水城ゆきかぜ", "Serif": "は……？　ゴムでできてるから、なんだっていうのよ……。はっ！？　そうか、絶縁体……！　くっ、くううっ、このっ、卑怯者……！", "Motion": 1, "Voice": "c_1706_2_022_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "戦闘員", "Serif": "卑怯だとも思わないが、なんと言われようと結果がすべてだ。このままおまえは、俺の性奴隷になってもらう", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "水城ゆきかぜ", "Serif": "ふざけんじゃ、ないわよっ、んんぐうぅううっ、ゴムのせいで抵抗できないとしてもっ、んんぁああっ、性奴隷になんて、なるわけない……っ！", "Motion": 1, "Voice": "c_1706_2_023_1706", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "戦闘員", "Serif": "どうやら俺のチンポは特別イイらしいぞ。まあ、言われただけで、他の男の勃起チンポを見たことはないし、挿れられたこともないんで本当かどうか知らないが……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "寄せては返す波のように、最奥までぐっと挿入し膣奥を圧迫したかと思えば、入り口近くまで腰を引く。かなり太いと思われる肉竿が、ゆきかぜの襞を力強く愛撫する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "水城ゆきかぜ", "Serif": "んんんぃいいいぃいっ！　はぁっ、あはぁあぁっ！？　こ、この程度っ、はぁっ、誰がっ、あんたなんかの粗チンで……っ、はぁっ、あっ、んぐうっ！", "Motion": 1, "Voice": "c_1706_2_024_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 21, "Name": "水城ゆきかぜ", "Serif": "んぎぃいいぃっ、ひぐううぅうっ！？　深いとこ、はぁっ、何度も擦られるとっ、んぐううぅっ、んぁっ、ああはああぁぁぁっ！！", "Motion": 1, "Voice": "c_1706_2_025_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "反応などしてやるものか、そう決意するゆきかぜだったが、しかし……男のモノは、確かにゆきかぜの膣内でも、特に敏感な箇所を適確に刺激していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "思わず甘い声が漏れ、そして膣肉は切なげに締め上げてしまう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 24, "Name": "戦闘員", "Serif": "いい声で鳴き始めたじゃねぇか。んー？　どうだ、俺のチンポが気持ちいいって認めちまえよ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "水城ゆきかぜ", "Serif": "ふ、ふざけん、なぁあああぁぁぁっ！？　んぐっ、ああああぁっ、ひぐううぅうううぅぅぅうっ！？　や、やめ、激しっ、ぃっ、んんううぅううぅっ！", "Motion": 1, "Voice": "c_1706_2_026_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "水城ゆきかぜ", "Serif": "あひいいぃいっ、ひぐぅっ、そんなに、したらっ、おまんこ、めくれちゃうううぅっ、はぁっ、あんぅうぅっ！", "Motion": 1, "Voice": "c_1706_2_027_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "水城ゆきかぜ", "Serif": "んひぁっ、はぁっ、んぎっ、んあ゛ぁっ！？　やめ、なさい、ってばぁ……っ、おまんこ、壊れちゃう、からぁっ！！", "Motion": 1, "Voice": "c_1706_2_028_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "戦闘員", "Serif": "壊れちゃうくらい、気持ちいいんだろ？　チンポ気持ちよくて嬉しいって、顔にそう書いてあるぞ？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "水城ゆきかぜ", "Serif": "んんぐうぅっ、そ、そんなわけ、ないでしょう、がぁ……っ、んんぅううぅっ！", "Motion": 1, "Voice": "c_1706_2_029_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "懸命に反発するゆきかぜ。その態度は、そうでもしないと男の言うとおりに快楽に負けてしまいそうだと感じていたからだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "", "Serif": "実際に、身体の方は何度も甘く肉竿を締め付け、悦んでしまっているのをゆきかぜ自身も自覚していた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "水城ゆきかぜ", "Serif": "あんた、なんかのっ、んんふううっ、汚い、チンポなんかにっ、はぁっ、んんぐうっ！　感じる、はず、ないからぁっ！", "Motion": 1, "Voice": "c_1706_2_030_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "戦闘員", "Serif": "素直に言えよ、感じてるんだろ？　さっきから何度も強く締め付けてきてるぞ。マンコは嘘をつかない", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "戦闘員", "Serif": "疑うんなら、てめえのマンコがなんて言ってるか、耳を傾けるんだな", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "", "Serif": "男はふいに、抽挿する角度を微調整する。と、もともと聞こえていた結合部の水音が、更に強調される。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "水城ゆきかぜ", "Serif": "あっ、やっ、いやああぁぁっ！？　そんなの、聞かせない、でぇぇっ！！　んぐうぅうっ、ふぁああっ、恥ずかしいからぁっ！　んぅううぅぅっ！！", "Motion": 1, "Voice": "c_1706_2_031_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "水城ゆきかぜ", "Serif": "ひっ、んんぅうっ、んひぃいいぃっ！　や、やだぁっ、あぁうっ、おまんこっ、かき混ぜられてぇええぇぇぇっ！", "Motion": 2, "Voice": "c_1706_2_032_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "水城ゆきかぜ", "Serif": "んひぃぃぃっ、ひぅうんっ！！　それ、もう、むりぃぃ……はぁ、んふぅっ、チンポじゅぼじゅぼされてぇ、おまんこ、めくれちゃうからぁぁっ！", "Motion": 2, "Voice": "c_1706_2_033_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "抜き挿しするごとに聞こえる卑猥な音が、男の欲望をさらに昂ぶらせ、抽挿は激しさを増していく。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "", "Serif": "とろとろに綻んだ牝花を乱されて、ゆきかぜは快感に身体を震わせた。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "戦闘員", "Serif": "そろそろ出すぞ……俺の子種を、しっかり味わえっ！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "水城ゆきかぜ", "Serif": "んぁああぁぁぁっ！？　ふ、ふざけないでっ、膣内でなんて絶対、だ、だめっ、はぁっ、んんぅううぅっ！？", "Motion": 2, "Voice": "c_1706_2_034_1706", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "", "Serif": "言葉では抵抗をみせるものの、膣肉は搾精するがのごとくすぼまり、肉竿はそのまま膣奥めがけ――", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "水城ゆきかぜ", "Serif": "あぎいいいぃっ！？　ひぎっ、ぃっ、んぅううぅっ！　出て、るぅううぅうぅうぅううっ！？　あっ、あはぁ、熱いぃいぃっ、いぐっ、いっぐぅうぅううぅぅうぅぅう！", "Motion": 1, "Voice": "c_1706_2_035_1706", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 45, "Name": "", "Serif": "その熱量に応じて、ゆきかぜも絶頂を迎えたのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 46, "Name": "", "Serif": "びくびくと身体を痙攣させながら、ぼんやりと力なく宙を見つめる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 47, "Name": "水城ゆきかぜ", "Serif": "あぁ、はああぁぁぁ……おなかの、なか……精液でいっぱいに、なって……んふぅうぅぅ……", "Motion": 1, "Voice": "c_1706_2_036_1706", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 48, "Name": "戦闘員", "Serif": "おまえの雷撃を克服した以上、俺とおまえの力関係はこういうことなんだよ。わかったら、次はケツマンコで楽しませてもらうかな", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 49, "Name": "水城ゆきかぜ", "Serif": "んはぁ……ケツ、マンコって……そんな、無理、だからぁ……", "Motion": 1, "Voice": "c_1706_2_037_1706", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 50, "Name": "", "Serif": "もはや抵抗するのにも力が入らないゆきかぜの腰をつかみ、男は下卑た笑みを浮かべるのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "凜子が追いついて男を切り伏せるのは、まだ少し後のこと――", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217071: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "", "Serif": "果たして、洞窟の奥から登場した魔物は２体のオークだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "下品な豚面で息も荒く、不知火を注視している。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "水城不知火", "Serif": "ふふっ……ずいぶん熱い視線をくれるのね。そんなに私の身体が気になるの？　仕方ないわね……だったらその、小さそうな脳みそに刻み込んであげる", "Motion": 1, "Voice": "c_1707_1_028_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "", "Serif": "唸りながら１体のオークが、振りかぶって渾身の一撃を食らわせる。それを受け流すものの、恐るべきパワーに不知火も笑みを引きつらせる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "水城不知火", "Serif": "とんでもない馬鹿力ね……こんなのに掴まれたら……きゃあああっ！？", "Motion": 1, "Voice": "c_1707_1_029_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "もう１体のオークが背後から不知火を羽交い締めにする。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "", "Serif": "片方が注意を引いている間に背後に回り込んだのだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "水城不知火", "Serif": "小さい脳みそなんて言って悪かったかしら……連携プレーなんて、なかなかやるじゃない……くっ、んんんっ！！", "Motion": 1, "Voice": "c_1707_1_030_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "オークは不知火の戦闘服を引き裂くと、醜悪なまでの巨根を彼女の股間にあてがい――", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "水城不知火", "Serif": "んんふうううぅうぅっ！？　んんっ、んぐっ、くうっ、ふと、すぎぃ……っ！？　はぁっ、あぐううっ！！", "Motion": 1, "Voice": "c_1707_1_031_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 11, "Name": "", "Serif": "背後のオークが不知火の身体を拘束したまま、その雄棒を突き立てる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "", "Serif": "何の前触れもなく、しかもオークの巨根では、さすがの不知火の秘裂も簡単には受け入れられない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "水城不知火", "Serif": "んっくううううっ、ふうっ、んっ、な、なにこのチンポっ、大きすぎるっ、んぐっ、はぁっ、くううっ！", "Motion": 1, "Voice": "c_1707_1_032_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "", "Serif": "人語を理解しているのか、それとも意味はないのか、オークは口元を下卑た笑みに歪める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "", "Serif": "そして、背後のオークは更に、浅い抽挿を繰り返しながら、徐々に膣奥へと突き立てていく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "水城不知火", "Serif": "これ以上はっ、はぁっ、んんぁあああぁぁっ！？　いやああぁっ、オマンコ、壊れちゃうからぁぁぁっ！！", "Motion": 1, "Voice": "c_1707_1_033_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 17, "Name": "水城不知火", "Serif": "んぎいぃいっっ、拡がっちゃうっ、はぁっ、オークのチンポサイズに、オマンコ拡げられちゃったら、もう普通のセックス、できなくなっちゃうぅっ！", "Motion": 1, "Voice": "c_1707_1_034_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 18, "Name": "", "Serif": "着実に根元まで飲み込まれるオークの雄棒。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "一方で、正面に回ったオークは、口の端から唾液を垂らしながら、不知火のはちきれそうな質量を誇る豊乳にむしゃぶりつく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 20, "Name": "水城不知火", "Serif": "んんはああぁぁぁあぁっ！？　い、いやっ、舐めないでぇっ！　私の、おっぱいっ、んっ、んぐうぅっ、オークなんかに、はぁっ、あぁっ！", "Motion": 1, "Voice": "c_1707_1_035_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 21, "Name": "水城不知火", "Serif": "あっ、私の、おっぱいはっ、はぁっ、ゆきかぜを育てた大事な……っ、はぁぅっ、あぁうんっ！　だめぇ、吸わないでっ、はぁっ、あふうぅっ！", "Motion": 1, "Voice": "c_1707_1_036_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "オークは舌で固くなった乳首を転がし、そして乳輪ごと大胆に吸い付く。興奮しているためか、常に唾液を垂らしており、吸い付くと卑猥な音が洞窟内に響いた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 23, "Name": "水城不知火", "Serif": "あぁふうううぅうぅっ！？　んっ、んふぁぁあっ、だめぇっ、チンポ、固くて、太くて、はぁっ、んぐ、くううぅっ！　オマンコのなかで動いてっ、はひいいぃっ！", "Motion": 1, "Voice": "c_1707_1_037_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 24, "Name": "", "Serif": "身悶えする不知火の身体に、少しずつ変化が訪れる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "肉茎を咥えこんだ膣口は、裂けてしまうのではないかというほど拡がっていたものの、いまは愛蜜をたっぷり流し始め、にちゃにちゃと雄棒を迎え入れていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "", "Serif": "そして、圧倒的な大きさを誇る乳房、その先端からは、乳白色の液体が垂れ始めていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "水城不知火", "Serif": "いやぁっ、あっ、おっぱい、出てきちゃってる……っ、んっ、いや、なのにっ、こんなふうに犯されて、いやなのに……どうしてぇっ、はぁんっ！", "Motion": 1, "Voice": "c_1707_1_038_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "水城不知火", "Serif": "こんなっ、はぁっ、チンポが大きいだけのセックス、気持ちよくなんか、ない、はずなのに……っ、んぐううぅぅっ、くっ、んふうぅうっ！", "Motion": 1, "Voice": "c_1707_1_039_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "", "Serif": "胸を舐めていたオークは、母乳が出てきたことに目を細めて、乳房に更に激しく吸い付き始める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "どこまで理解しているかは不明だが、やはりオークであっても母乳には惹かれるようだ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "水城不知火", "Serif": "いやあぁぁあぁっ！？　おっぱい、飲ま、ないでぇっ！　オークなんかに、飲ませるものじゃ、ない、のにぃっ！　んぐっ、んんぅううっ！", "Motion": 2, "Voice": "c_1707_1_040_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "水城不知火", "Serif": "あ、あぁっ、もう、だめぇっ、子宮に、当たって……ううんっ、入って、来ちゃってるぅっ！　んっ、んぐうううっ！", "Motion": 2, "Voice": "c_1707_1_041_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "", "Serif": "オークの巨根を飲み込んでいた不知火の膣穴は、いまや抜き挿しされる度に、ぶびゅるっ、と蜜汁を噴き出していた。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "水城不知火", "Serif": "んぎいぃいっ！？　わ、わかる、わかっちゃうのっ、んふぉおおおおっ！　入って、きちゃってるぅううっ！　子宮の、なかまでっ、オークチンポがっ、あっ、んあああぁぁぁっ！？", "Motion": 2, "Voice": "c_1707_1_042_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "水城不知火", "Serif": "こんなの、むりっ、も、ガマン、できないいいぃいっ！　イッちゃうっ、イクっ、イクっ、イクぅううぅうぅぅぅ――っ！！", "Motion": 1, "Voice": "c_1707_1_043_1707", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "不知火が絶頂すると同時に、その膣肉の締め付けに耐えかね、オークもまた射精する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 37, "Name": "", "Serif": "そして絶頂の瞬間、母乳は激しく乳首から噴き出し、美しい放物線を描いて地面を濡らした。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 38, "Name": "水城不知火", "Serif": "あ、あへぇ……どうしよぉ……はひぇええ……すごく、たくさん、出されちゃったぁ……", "Motion": 1, "Voice": "c_1707_1_044_1707", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 39, "Name": "水城不知火", "Serif": "子宮の、中にまでチンポが入ってきてたのに……そのまま、出されちゃった……オークのこども、孕んじゃったら、どうしよう……", "Motion": 1, "Voice": "c_1707_1_045_1707", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 40, "Name": "", "Serif": "ぐったりしながら虚空を見つめる不知火。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 41, "Name": "", "Serif": "だがオークたちはまだ性欲がおさまらないようで、大量の精液を溢れさせた膣を、再び犯し始めるのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 42, "Name": "", "Serif": "不知火の魅惑的な肉体がもたらす快楽に酔いしれ、２体のオークは舌を伸ばし、唾液を垂らしながら恍惚としていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 43, "Name": "水城不知火", "Serif": "……ふふっ。どうやら素敵な夢を見ているようね。その小さな脳みそが壊れるまで、私の最高のオマンコ、味わってるといいわ", "Motion": 1, "Voice": "c_1707_1_046_1707", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 44, "Name": "水城不知火", "Serif": "私も年はとったけど『幻影の対魔忍』って言われてたんだから。オーク程度に遅れをとるわけにはいかないのよ。それじゃあ、私は行くわ。引き続き、良い夢を", "Motion": 1, "Voice": "c_1707_1_047_1707", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 45, "Name": "", "Serif": "不知火の言葉は当然、オークたちの耳には届いていない。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 46, "Name": "", "Serif": "２体のオークは、快楽の夢に耽溺し、そのまま朽ち果てるのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217072: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "", "Serif": "ボラコに操られたきらら、アサギに拉致され、敵拠点に拘束されていたときの記憶が蘇る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_44", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "確かに、アサギ以外にもうひとり拠点にいたとは思っていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "水城不知火", "Serif": "あなたがいた世界でも、私たちの戦いの記録が語り継がれているのね。だから私の顔を見て、名前がすぐに分かった……なんだか不思議ね", "Motion": 1, "Voice": "c_1707_2_020_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "水城不知火", "Serif": "だってそうでしょう。世界を超えて、こうして繋がるなんて……", "Motion": 1, "Voice": "c_1707_2_021_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "", "Serif": "至って真面目な話だ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "", "Serif": "なのに、彼女の口から『繋がる』なんて単語が出ただけで、激しく動揺してしまう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "", "Serif": "そう、拘束されていたとき、目隠しをされたまま誰かに跨がられてそのまま……いま考えると、あれは不知火だったのか。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "水城不知火", "Serif": "あ、思い出しちゃった？　そうよ、私よ。それで今日も、お願いがあってきたのよ……", "Motion": 1, "Voice": "c_1707_2_022_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "", "Serif": "お願いとは何かを説明することもなく、不知火はこちらの服を脱がせると、大胆に脚を開いて上にまたがってきた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "水城不知火", "Serif": "ふふっ、こうすると、あのときのこと……ますます思い出しちゃうわね", "Motion": 1, "Voice": "c_1707_2_023_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "", "Serif": "あのときも確かに騎乗位だった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "", "Serif": "思い出しただけで固くなったペニスを、不知火は微笑みながら握り、そして自身の秘部へと導いていく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "水城不知火", "Serif": "ん……はぁっ、前より、チンポ固いわね……んっ、あぁっ", "Motion": 1, "Voice": "c_1707_2_024_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 14, "Name": "", "Serif": "前回は目隠しをされていて、相手が誰かも分からない状態でのセックスだった。恐怖が先にきて、十分に性欲に没頭できなかったのも当然だろう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "", "Serif": "だが、今は……目の前には、不知火の完璧なプロポーションがある。手を伸ばせば触れられる距離に、だ。それどころか、薄ピンク色の柔肉に包まれているのも丸見えなのだ。これで全力で勃起しなかったら嘘だろう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "水城不知火", "Serif": "そんなこと言って……あなた、口が上手いのね。こんな年増女をつかまえて、そんなふうに褒めそやしてどうするつもり？", "Motion": 1, "Voice": "c_1707_2_025_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "水城不知火", "Serif": "でも……素直に嬉しいわ。そんなふうに言ってくれて……んっ、はぁっ、わかるでしょ、ほら……私のオマンコも悦んでるの、あなたのチンポに伝わってるはず……♪", "Motion": 1, "Voice": "c_1707_2_026_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "水城不知火", "Serif": "んっ、はぁんっ、んんっ♪　どんどん硬くなって……はぁっ、あぁんっ、奥まで、んっ、届いちゃうぅっ♪", "Motion": 1, "Voice": "c_1707_2_027_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "頬を染めて腰を上下させる不知火。当然、その豊乳は目の前でゆさゆさと連動して揺れる。たまらず指先を伸ばしつつも、本題だけは確認する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "水城不知火", "Serif": "ふふっ、そんなにうっとりしてるのに、頭は冷静なのね。素敵よ♪", "Motion": 1, "Voice": "c_1707_2_028_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "水城不知火", "Serif": "実は……洗脳する薬は強烈な副作用があったの。性欲がとても強くなってしまう、っていうね……だからあのとき、私は強引にあなたを襲った", "Motion": 1, "Voice": "c_1707_2_029_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "水城不知火", "Serif": "でも、おかげであなたのそのエルマイトで……私は正気に戻ることができたのよ。けど、急いで脱出したから、まだ薬が完全に抜けきっていなくて……", "Motion": 1, "Voice": "c_1707_2_030_1707", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "不知火は口元に笑みを浮かべると、ぐっと根元まで飲み込むようにして、腰を沈める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "水城不知火", "Serif": "だから、んっ、あなたのエルマイト……もらいにきたの……♪　んっ、はふぅううっ、それに、性欲もまだ……んっ、んふううっ", "Motion": 1, "Voice": "c_1707_2_031_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 25, "Name": "水城不知火", "Serif": "あっ、んんぅううっ、気持ち、いいっ……こんなたくましいチンポでっ、ズコズコされちゃったらぁっ、はぁっ、気持ちよくて、オマンコひくひくしちゃううぅっ……♪", "Motion": 1, "Voice": "c_1707_2_032_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 26, "Name": "水城不知火", "Serif": "あん、やだぁ……おっぱい、出てきちゃった……♪", "Motion": 1, "Voice": "c_1707_2_033_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 27, "Name": "", "Serif": "乳首から垂れ落ちる乳白色の液体に、思わず舌を伸ばしてしまう。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 28, "Name": "", "Serif": "それを見逃さなかった不知火は、妖艶に笑って、こちらの頭を撫でた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 29, "Name": "水城不知火", "Serif": "おっぱい、好きなの……？　いいわ、んっ、じゃあこうしましょ……私のために、エルマイトをたくさん出して……？　とっても濃厚な、エルマイト……♪", "Motion": 1, "Voice": "c_1707_2_034_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "水城不知火", "Serif": "いっぱい出せたら……ご褒美に、おっぱい飲ませてあげる……それでどう？　頑張れるかしら……ふふっ", "Motion": 1, "Voice": "c_1707_2_035_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "", "Serif": "既にこの状況がご褒美のようなものなのに。更に母乳が追加されるとは。否が応でも、不知火を満足させたいと強く思う。エルマイトだけではなく、純粋な快楽の面でも。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "水城不知火", "Serif": "んんふううぅっ、こんなにチンポ固くしてっ、そんなにおばさんマンコがいいの……？　んうぅうっ、じゃあもっと、動いちゃうわよ……♪", "Motion": 1, "Voice": "c_1707_2_036_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "水城不知火", "Serif": "んんぅううっ、はぁんっ、んっ、んくぅううっ、おあっぁああっ！　チンポ、すごいのっ、はぁっ、気持ちいいとこ、当たってぇ……っ！", "Motion": 1, "Voice": "c_1707_2_037_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "水城不知火", "Serif": "ほらぁ……んっ、あなたも、がんばって♪　私のために、いっぱい濃厚なエルマイト、出してね……っ、んっ、ふぁああっ", "Motion": 1, "Voice": "c_1707_2_038_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "", "Serif": "声援を受けて、肉棒は不知火のナカでさらに膨張する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "その圧力に、不知火はますます表情を色づかせていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "水城不知火", "Serif": "あふううぅううっ♪　チンポ、がんばってるねっ、んっ、はぁんっ、いっぱい固くなって、私のオマンコ、気持ちよくしてくれて……っ♪", "Motion": 1, "Voice": "c_1707_2_039_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "水城不知火", "Serif": "がんばれっ、がんばれっ♪　んっ、あぁんっ、私の子宮に、エルマイトザーメン、たくさんっ、ちょうだいぃいいっ、あぁっ、はぁっ", "Motion": 2, "Voice": "c_1707_2_040_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "次々に垂れ落ちる母乳、淫らに乱れる不知火の姿、高まる情欲は一気にエルマイトに置き換わり、そして――", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "水城不知火", "Serif": "あああぁっ！？　出るのっ、出るのねっ、お願いっ、オマンコにナマでっ、中出しでイカせてええぇぇっ！", "Motion": 2, "Voice": "c_1707_2_041_1707", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "", "Serif": "たまらず膣奥めがけて射精する。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "", "Serif": "自分でも驚くほどの精液量で、何度も竿が震えた。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "水城不知火", "Serif": "あっっふううぅうぅっ！　イッちゃうっ、ザーメン、オマンコに出されてっ、イッちゃうっ、いぐっ、いぐうぅううっ！", "Motion": 1, "Voice": "c_1707_2_042_1707", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 44, "Name": "", "Serif": "射精の衝撃に不知火も絶頂し、そして母乳が勢いよく噴き出した。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 45, "Name": "", "Serif": "自分の射精よりも勢いがあるのではと思えるほど、強い圧力で噴出した母乳は、こちらの顔や身体に降りかかる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 46, "Name": "水城不知火", "Serif": "ふふっ……とっても濃厚なザーメン……エルマイトが出たわ。よくがんばったわね。いいこ、いいこ", "Motion": 1, "Voice": "c_1707_2_043_1707", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 47, "Name": "", "Serif": "幼子にするように、こちらの頭を撫でる不知火。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 48, "Name": "", "Serif": "心地よさに思わず目を細めていると、鼻先に乳房が突きつけられる。その先端は、今もなおこぼれる母乳で濡れていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 49, "Name": "水城不知火", "Serif": "じゃあ約束どおり、おっぱい……飲んで♪", "Motion": 1, "Voice": "c_1707_2_044_1707", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 50, "Name": "", "Serif": "むしゃぶりついて母乳を吸う。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "もちろん、そんなことそすればすぐさま肉棒も復活して……何度も、不知火の熟れた肉体を堪能することになるのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217081: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "", "Serif": "気がつくと、いつのまにか宿の部屋に戻っていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_44", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "", "Serif": "凜子に感謝され、体に触れられた時、全身が燃え上がるように熱くなった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "", "Serif": "そして急に湧き上がった性欲に突き動かされ、気付くといつの間にかオナニーを始めていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "秋山凜子", "Serif": "大丈夫か？　薬を買ってきたから、これを飲んで安静に……", "Motion": 1, "Voice": "c_1708_1_025_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "秋山凜子", "Serif": "なっ、なにっ！？お、お前！　いったい何をしている！？", "Motion": 1, "Voice": "c_1708_1_026_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "秋山凜子", "Serif": "いや、やはり答えなくていい！その、じ、自慰をしていたんだろう？", "Motion": 1, "Voice": "c_1708_1_027_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "", "Serif": "あろうことか、凜子に行為の最中を見られてしまった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "", "Serif": "情けなさと羞恥心が、一気にこみ上げる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "秋山凜子", "Serif": "なっ、そんな申し訳なさそうな顔をするな。悪いのは、勝手に入った私のほうだ", "Motion": 1, "Voice": "c_1708_1_028_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "秋山凜子", "Serif": "年頃の男子の部屋に入るときは、必ずノックをする。弟を持つ身でありながら、それをすっかり忘れていた……", "Motion": 1, "Voice": "c_1708_1_029_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "秋山凜子", "Serif": "なっ、泣くな！　そうだ！　私が代わりに慰めてやる。お前には先の戦いでの借りがあった", "Motion": 1, "Voice": "c_1708_1_030_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "", "Serif": "凜子はそう言って半ば強引に肉竿を握る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "秋山凜子", "Serif": "悪いが、私にも事情があってな。本番まではしてやれない", "Motion": 1, "Voice": "c_1708_1_031_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 14, "Name": "秋山凜子", "Serif": "だから、口で奉仕してやろう。はむっ……", "Motion": 1, "Voice": "c_1708_1_032_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "秋山凜子", "Serif": "んむっ、ちゅぷっ、ふううっ……", "Motion": 1, "Voice": "c_1708_1_033_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 16, "Name": "", "Serif": "抵抗する間もなく、凜子に肉竿を咥えられる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "", "Serif": "口内の湿った温もりが亀頭から脳天まで伝わり、思わず声が出そうになる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "秋山凜子", "Serif": "ふむうっ、ふうっ……どうだ……？　嫌じゃ、ないか……？", "Motion": 1, "Voice": "c_1708_1_034_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "", "Serif": "凜子は肉竿を咥えたまま、呂律の回らない声で喋る。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "", "Serif": "こちらはそれに、首を縦に振って応じる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "秋山凜子", "Serif": "ふふ……なら、よかった……んちゅっ、んむうっ……", "Motion": 1, "Voice": "c_1708_1_035_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "", "Serif": "凜子は弟を思いやる姉のような、慈愛を込めた表情で微笑む。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "", "Serif": "そんな彼女の笑顔を見ていると、先程感じた罪悪感は一気に消し飛んでしまった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "秋山凜子", "Serif": "では、始めるぞ……はむっ、むふううっ……", "Motion": 1, "Voice": "c_1708_1_036_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 25, "Name": "", "Serif": "ゆっくりと前後運動を始める凜子。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 26, "Name": "", "Serif": "露わになった豊満な胸が、それと同時に揺れはじめる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 27, "Name": "秋山凜子", "Serif": "れろっ……ふむううっ、んちゅううっ……", "Motion": 1, "Voice": "c_1708_1_037_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 28, "Name": "", "Serif": "舌の上で肉竿が転がされ、ザラザラとした触感が裏筋を刺激する。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 29, "Name": "秋山凜子", "Serif": "んむっ、んちゅっ、ちゅううっ……ふうっ、んちゅうううっっ", "Motion": 1, "Voice": "c_1708_1_038_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 30, "Name": "", "Serif": "前後運動に吸いつきが加わり、刺激はさらに強まる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 31, "Name": "", "Serif": "そして精液を搾り取るかのような強烈な吸引で、とうとう我慢汁が漏れはじめた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 32, "Name": "秋山凜子", "Serif": "じゅるるるっっ……じゅうっ……いいぞ……気持ちよくなったら、いつでも出してくれ……", "Motion": 1, "Voice": "c_1708_1_039_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 33, "Name": "", "Serif": "我慢汁と唾液が混ざりあい、淫らな水音を奏でる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "", "Serif": "そのためか、目を閉じると凜子と同衾しているような錯覚に陥るのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "秋山凜子", "Serif": "ふううっ……ふふっ、気持ちいいか……？", "Motion": 1, "Voice": "c_1708_1_040_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "", "Serif": "こちらを見上げ、優しく訊ねる凜子。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "", "Serif": "自分はその問いに、こくりと頷く。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "秋山凜子", "Serif": "ふふっ……嬉しいぞ……ふむっ、じゅるるるっっっ、んちゅううっっ", "Motion": 1, "Voice": "c_1708_1_041_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "", "Serif": "強烈なストロークと吸引、そして生温かい肉の感触。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "", "Serif": "凜子の口内は、まるで本物の膣のように仕上がっていた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "秋山凜子", "Serif": "んちゅううっ、じゅるるるっ、んちゅうううっっ……！", "Motion": 1, "Voice": "c_1708_1_042_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "秋山凜子", "Serif": "ではさらに、れろっ……ぶちゅうっ、じゅるるるっっっ……", "Motion": 1, "Voice": "c_1708_1_043_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "", "Serif": "凜子の攻めはまだ終わっていなかった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "", "Serif": "舌先が膣襞のようにうねうねと波うち、肉竿全体をもてあそぶ。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 45, "Name": "秋山凜子", "Serif": "じゅるるっ、むっ、ふむうううっっっっ！", "Motion": 1, "Voice": "c_1708_1_044_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 46, "Name": "", "Serif": "凜子の巧みな性技により、限界まで勃起していた肉竿が口内でさらに膨れ上がる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 47, "Name": "", "Serif": "それに連動するかのように、凜子の頬がさらに紅潮していく。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 48, "Name": "", "Serif": "まるで彼女も、性感帯のないはずの口で感じ、興奮しているかのようだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 49, "Name": "秋山凜子", "Serif": "まったく、こんなに大きくして……ほああっ……ぶちゅううっっ、ぶじゅううっっっ！", "Motion": 2, "Voice": "c_1708_1_045_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 50, "Name": "秋山凜子", "Serif": "ふううっ……そろそろイキたいだろう……？遠慮はいらん、私の口に……ぐちゅうううっっっ！", "Motion": 2, "Voice": "c_1708_1_046_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 51, "Name": "", "Serif": "凜子の全力のストロークで、興奮が最高潮に達する。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 52, "Name": "", "Serif": "精液は亀頭の先まで上り詰め、すでに暴発寸前だった。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 53, "Name": "秋山凜子", "Serif": "さあ……ぶじゅうううっ！！思い切りっ、じゅぶうっっっ！　出してくれっ……！", "Motion": 2, "Voice": "c_1708_1_047_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 54, "Name": "", "Serif": "興奮の極致に達し、声を荒らげる凜子。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 55, "Name": "", "Serif": "それに応えるかのように、こちらもついに絶頂した。", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 56, "Name": "秋山凜子", "Serif": "んあっ……！ああああっっ！　ふあああああっっ……！", "Motion": 1, "Voice": "c_1708_1_048_1708", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 57, "Name": "", "Serif": "大量の精液が放たれ、凜子の肌を真白く染める。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 58, "Name": "秋山凜子", "Serif": "ふううっ……どうだ……？気持ちよかったか……？", "Motion": 1, "Voice": "c_1708_1_049_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 59, "Name": "", "Serif": "凜子は愚息を咥えたまま、惚けたような声で訊ねる。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 60, "Name": "", "Serif": "こちらも息を荒らげながら、返事の代わりにゆっくりと頷く。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 61, "Name": "秋山凜子", "Serif": "そうか……よかった。なら、借りは返せたな……", "Motion": 1, "Voice": "c_1708_1_050_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 62, "Name": "秋山凜子", "Serif": "お前が満足してくれたなら……元気になってくれたなら、何も言うことはない", "Motion": 1, "Voice": "c_1708_1_051_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 63, "Name": "", "Serif": "凜子は恍惚とした表情で、満足そうに微笑むのだった。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
    OTOGI_217082: {
        SCRIPTS: {
            PART1: {
                SCRIPT: [{"Order": 1, "Name": "支配人", "Serif": "では、下ごしらえといきましょう", "Motion": 1, "Voice": "", "StillPath": null, "BGM": "bgm_43", "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 2, "Name": "秋山凜子", "Serif": "なっ、なんだその液体は？", "Motion": 1, "Voice": "c_1708_2_013_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 3, "Name": "支配人", "Serif": "感度を数百倍にまで上げる催淫剤です。その効果を、たった今ご覧にいれましょう", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 4, "Name": "秋山凜子", "Serif": "やめろ！　そんなものを塗る……なはあああっ！？", "Motion": 1, "Voice": "c_1708_2_014_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 5, "Name": "秋山凜子", "Serif": " (くうっ……ほんの数滴塗られただけで、乳首が、体中が焼けるように熱い……！)", "Motion": 1, "Voice": "c_1708_2_015_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 6, "Name": "秋山凜子", "Serif": " (この感覚は、ヨミハラで味わったものに似ている！まさか、ノマドの置き土産か！？)", "Motion": 1, "Voice": "c_1708_2_016_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 7, "Name": "支配人", "Serif": "やはり効きますね、薬草『ドレイク』から作った催淫剤は。もし薄めずに使ったら、どうなってしまうのでしょうね？ふふふ……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 8, "Name": "秋山凜子", "Serif": "なっ、『ドレイク』だと！？", "Motion": 1, "Voice": "c_1708_2_017_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 9, "Name": "秋山凜子", "Serif": " (忘れもしない、あのヨミハラで使われたものと同じ原料ではないか！)", "Motion": 1, "Voice": "c_1708_2_018_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 10, "Name": "秋山凜子", "Serif": " (この娼館にも、ノマド・オトギ支部の残党が潜んでいる。早く抜け出し、皆に知らせなくては。だが、錯乱状態では術も使えん……！)", "Motion": 1, "Voice": "c_1708_2_019_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 11, "Name": "支配人", "Serif": "では早速、この下着を着て奉仕してもらいましょうか", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 12, "Name": "秋山凜子", "Serif": "なっ、離せ！　やめろぉぉっ！", "Motion": 1, "Voice": "c_1708_2_020_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 13, "Name": "秋山凜子", "Serif": "くうっ、はあああっ！", "Motion": 1, "Voice": "c_1708_2_021_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": "2"}, {"Order": 14, "Name": "村人１", "Serif": "おお、いい締まりじゃねえか。汁もダラダラでいい具合だぜ？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 15, "Name": "秋山凜子", "Serif": "くっ、言うなっ……", "Motion": 1, "Voice": "c_1708_2_022_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 16, "Name": "村人２", "Serif": "乳の具合もバツグンだ。揉めば揉むだけ、乳首がコリコリに勃ってきやがる", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 17, "Name": "秋山凜子", "Serif": "はあああっ！　違うっ、それは薬のせいで……はあっ！", "Motion": 1, "Voice": "c_1708_2_023_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 18, "Name": "支配人", "Serif": "ほう？　本当に薬のせいだけでしょうか？あなたがこんなにも乱れているのは", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 19, "Name": "支配人", "Serif": "もしかして、淫乱の素質がおありなのでは？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 20, "Name": "秋山凜子", "Serif": "ぐっ、ふざけるな……！", "Motion": 1, "Voice": "c_1708_2_024_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 21, "Name": "秋山凜子", "Serif": "（だが、確かに私は興奮している。薬のせいだけではない。この下着……以前に着せられたものに似ている）", "Motion": 1, "Voice": "c_1708_2_025_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 22, "Name": "秋山凜子", "Serif": "（あの時の淫行を思い出し、無意識に興奮していたのか？そんな馬鹿な、ありえん……）", "Motion": 1, "Voice": "c_1708_2_026_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 23, "Name": "村人１", "Serif": "ほら、頑なになってねえで素直になっちまえよ。本当は好きなんだろ？　こうしてヤられんのが", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 24, "Name": "秋山凜子", "Serif": "ふざけるな、誰が好き好んで、こんなことを……くはあああっ！！", "Motion": 1, "Voice": "c_1708_2_027_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 25, "Name": "秋山凜子", "Serif": "（くっ……このまま嬲られていては取り返しのつかないことになる……）", "Motion": 1, "Voice": "c_1708_2_028_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 26, "Name": "秋山凜子", "Serif": "くそおおっ！　今すぐ解放しろおおっ！", "Motion": 1, "Voice": "c_1708_2_029_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 27, "Name": "支配人", "Serif": "そんなに暴れられては困ります。あなたは娼婦。お客様を喜ばせてこそ、その身の安全が保証されるのです", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 28, "Name": "支配人", "Serif": "もしこれ以上抵抗する気ならより強力な媚薬で従順にしてさしあげましょう", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 29, "Name": "秋山凜子", "Serif": "くっ、ゲスが……この代償は、高くつくぞ……！", "Motion": 1, "Voice": "c_1708_2_030_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 30, "Name": "村人１", "Serif": "おいおい。オーナーとばっかおしゃべりしてないで俺らのことも構ってくれよ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 31, "Name": "秋山凜子", "Serif": "黙れっ、くはあああっ！？", "Motion": 1, "Voice": "c_1708_2_031_1708", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 32, "Name": "", "Serif": "男が肉竿をより深くまで挿入し、力強く抽送を始めた。", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 1, "SE": "", "Effect": null}, {"Order": 33, "Name": "秋山凜子", "Serif": "馬鹿なっ……今まで、加減していたのか……！？", "Motion": 1, "Voice": "c_1708_2_032_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 34, "Name": "村人１", "Serif": "ああ。お楽しみはこれから、ってな。ほら、もっと情けねえ声で喘げ！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 35, "Name": "秋山凜子", "Serif": "ああっ、はああああっ！　あぐっ、ああああっ！", "Motion": 1, "Voice": "c_1708_2_033_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 36, "Name": "村人２", "Serif": "ははっ、すっかりトロけた顔になってきたな。お前、娼婦の才能あるぜ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 37, "Name": "秋山凜子", "Serif": "くふううっ……黙れ、私は対魔忍だ。娼婦でもなければ、奴隷でもない……！", "Motion": 1, "Voice": "c_1708_2_034_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 38, "Name": "支配人", "Serif": "ふふ、我慢強いですね。ですが、いつまで持ちますかな？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 39, "Name": "村人２", "Serif": "オラッ！　膣にばっか集中してねえでもっと乳にも気合い入れろや！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 40, "Name": "秋山凜子", "Serif": "ううっ、ふああああっっ！？", "Motion": 1, "Voice": "c_1708_2_035_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 41, "Name": "村人２", "Serif": "ふう、やっぱでけえ乳は揉みがいがあるぜ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 42, "Name": "秋山凜子", "Serif": "やめろっ……そんな乱暴に、揉むなっ……！", "Motion": 1, "Voice": "c_1708_2_036_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 43, "Name": "村人２", "Serif": "おおっ、すげえ！　汗で乳が余計プルプルになったぜ！やればできんじゃねえか、見直したぜ新人ちゃん", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 44, "Name": "秋山凜子", "Serif": "ち、ちがっ、私じゃない！", "Motion": 1, "Voice": "c_1708_2_037_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 45, "Name": "", "Serif": "体が勝手に……ふわああああっ！？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 46, "Name": "村人１", "Serif": "うおっ！急に膣の締まりがよくなりやがった！", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 47, "Name": "村人２", "Serif": "へへ、俺が頑張って乳を責めてやったからな", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 48, "Name": "村人１", "Serif": "サンキュー兄弟！　あとで俺にも揉ませてくれよ？", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 49, "Name": "秋山凜子", "Serif": "（くうっ……こいつら、私の体を玩具のようにもてあそんで……ああああっ！）", "Motion": 1, "Voice": "c_1708_2_038_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 50, "Name": "秋山凜子", "Serif": "（だ、だめだ。頭が、目の前が真っ白になる……！）", "Motion": 1, "Voice": "c_1708_2_039_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 51, "Name": "秋山凜子", "Serif": "はああああっ！！　あああああああっ！！かはあああああああっ！", "Motion": 2, "Voice": "c_1708_2_040_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 52, "Name": "支配人", "Serif": "おやおや、すっかり淫乱の顔つきになりましたね", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 53, "Name": "秋山凜子", "Serif": "ひっ、ひがうっ！　わたひはっ！", "Motion": 2, "Voice": "c_1708_2_041_1708", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 54, "Name": "村人２", "Serif": "ハハ、もう何言ってんのか分かんねえや", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 55, "Name": "村人１", "Serif": "オラっ！　さっさとイっちまえ！", "Motion": 2, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 2, "SE": "", "Effect": null}, {"Order": 56, "Name": "秋山凜子", "Serif": "ああああぁぁぁっっっっ！！いっ、いぐうううぅぅっっっっ！！", "Motion": 1, "Voice": "c_1708_2_042_1708", "StillPath": null, "BGM": null, "CharaAnimation": 3, "SE": "", "Effect": null}, {"Order": 57, "Name": "秋山凜子", "Serif": "はっ、はひいいい……", "Motion": 1, "Voice": "c_1708_2_043_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": "1"}, {"Order": 58, "Name": "村人１", "Serif": "ふーっ、気持ちよかった。長い間溜めてた甲斐があったぜ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 59, "Name": "村人２", "Serif": "おいおい、出しすぎだろ。あとで使う奴のことも考えろって", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 60, "Name": "支配人", "Serif": "ご心配には及びません。次のプレイまでに綺麗にしておきますので。ですよね？　凜子さん", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 61, "Name": "秋山凜子", "Serif": "はあっ、ああああっ……ああっ……", "Motion": 1, "Voice": "c_1708_2_044_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 62, "Name": "村人２", "Serif": "あーあ。すっかり呆けてやがる", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 63, "Name": "村人１", "Serif": "二回戦まで持つかね、これ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 64, "Name": "秋山凜子", "Serif": "へへ、へへへ……", "Motion": 1, "Voice": "c_1708_2_045_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 65, "Name": "村人２", "Serif": "おいおい、笑ってらあ", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 66, "Name": "村人１", "Serif": "はは、すっかり快楽のとりこだな。これからが楽しみだぜ、新人ちゃん", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 67, "Name": "支配人", "Serif": "ええ。この二号店の新しい稼ぎ頭になってくれるでしょう。ふふふ……", "Motion": 1, "Voice": "", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 68, "Name": "秋山凜子", "Serif": "へ、へへ……", "Motion": 1, "Voice": "c_1708_2_046_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}, {"Order": 69, "Name": "秋山凜子", "Serif": "（すまないみんな、達郎……私は今度こそ、ダメみたいだ……）", "Motion": 1, "Voice": "c_1708_2_047_1708", "StillPath": null, "BGM": null, "CharaAnimation": 4, "SE": "", "Effect": null}],
            },
        }
    },
}
main.info.otogi_h.date='2021-01-19';main.info.otogi_h.desc='Added Kirara, Yukikaze, Shiranui and Rinko.'